import{_ as p,r as e,o as n,c as t,a,b as h,F as s,d as r,e as c}from"./app.3799c3e6.js";const o={},l={id:"\u1112\u1161\u11B7\u1101\u1166-\u110C\u1161\u1105\u1161\u1100\u1175",tabindex:"-1"},u=a("a",{class:"header-anchor",href:"#\u1112\u1161\u11B7\u1101\u1166-\u110C\u1161\u1105\u1161\u1100\u1175","aria-hidden":"true"},"#",-1),b=r(),f={href:"http://www.kyobobook.co.kr/product/detailViewKor.laf?mallGb=KOR&ejkGb=KOR&barcode=9788966262335",target:"_blank",rel:"noopener noreferrer"},x=r("\uD568\uAED8 \uC790\uB77C\uAE30"),g=c('<h2 id="\u1106\u1165\u1105\u1175\u1106\u1161\u11AF" tabindex="-1"><a class="header-anchor" href="#\u1106\u1165\u1105\u1175\u1106\u1161\u11AF" aria-hidden="true">#</a> \uBA38\uB9AC\uB9D0</h2><blockquote><p><strong>\uB0B4\uAC00 \uC815\uB9D0 \uC798\uD560 \uC218 \uC788\uC744\uAE4C? \uC544\uB2C8, \uC6B0\uB9AC\uAC00 \uC815\uB9D0 \uC790\uB784 \uC218 \uC788\uC744\uAE4C?&quot;</strong></p></blockquote><ul><li>\uBB34\uC5C7\uC774\uAC74 \uC2E4\uC81C \uBC14\uAE65\uC138\uC0C1(\uC57C\uC0DD)\uC5D0 \uC784\uD329\uD2B8\uB97C \uB0A8\uAE30\uB824\uBA74 \uD63C\uC790 \uD798\uC73C\uB85C\uB9CC \uB418\uB294 \uAC8C \uC5C6\uB294 \uAC83 \uAC19\uC2B5\uB2C8\uB2E4. \uD568\uAED8 \uD574\uC57C \uD569\uB2C8\uB2E4.</li><li>\uC138\uC0C1\uC740 \uD568\uAED8 \uD574\uC57C \uBB54\uAC00 \uC774\uB8F0 \uC218 \uC788\uB294\uB370 \uC65C \uC6B0\uB9AC\uB294 \uD63C\uC790 \uD558\uB294 \uAC83\uB9CC \uBC30\uC6B8\uAE4C\uC694.</li><li>\uC138\uAC00\uC9C0 \uC9C8\uBB38 <ul><li>\uB0B4\uAC00 \uC815\uB9D0 \uC790\uB784 \uC218 \uC788\uC744\uAE4C?</li><li>\uC6B0\uB9AC\uAC00 \uC815\uB9D0 \uD568\uAED8 \uC790\uB784 \uC218 \uC788\uC744\uAE4C?</li><li>\uC6B0\uB9AC\uAC00 \uC815\uB9D0 \uB9E4\uC77C\uB9E4\uC77C \uD568\uAED8 \uC790\uB784 \uC218 \uC788\uC744\uAE4C?</li></ul></li><li>\uC800\uB294 \uD559\uC2B5\uC758 \uBCF8\uC758\uB294 \uC57C\uC0DD \uD559\uC2B5\uC5D0 \uB354 \uAC00\uAE5D\uB2E4\uACE0 \uC0DD\uAC01\uC744 \uD558\uACE0, \uD604\uC2E4 \uC138\uACC4\uC5D0\uC11C\uB294 \uC57C\uC0DD \uD559\uC2B5\uC774 \uB354 \uB9CE\uC774 \uD544\uC694\uD558\uB2E4\uACE0 \uBD05\uB2C8\uB2E4. \uADF8\uB798\uC11C \uC774 \uCC45\uC5D0\uC11C \uD559\uC2B5\uC744 \uC774\uC57C\uAE30\uD560 \uB54C\uC5D0\uB294 \uB300\uBD80\uBD84\uC758 \uACBD\uC6B0 \uC57C\uC0DD \uD559\uC2B5\uC744 \uC5B8\uAE09\uD558\uB294 \uAC83\uC774\uB77C\uACE0 \uBCF4\uBA74 \uB418\uACA0\uC2B5\uB2C8\uB2E4.</li><li>\uC218\uD30C\uB9AC \uC774\uC57C\uAE30\uB85C \uB9C8\uBB34\uB9AC\uD558\uBA74 \uC88B\uACA0\uC2B5\uB2C8\uB2E4. ... \uC218\uD30C\uB9AC\uB294 \uD2B9\uD788 \uC81C 1\uB2E8\uACC4(\uC77C\uB2E8 \uADDC\uCE59\uC744 \uBB34\uC870\uAC74\uC801\uC73C\uB85C \uBC1B\uC544\uB4E4\uC774\uACE0 \uB530\uB974\uB294 \uB2E8\uACC4)\uB97C \uAC15\uC870\uD558\uAE30 \uC704\uD574 \uC4F0\uC774\uB294\uB370, \uADF8 \uBBF8\uBA85\uD558\uC5D0\uC11C \uC5BC\uB9C8\uB098 \uB9CE\uC740 \uAD50\uC721\uC801 \uD3ED\uB825\uC774 \uC790\uD589\uB418\uC5B4 \uC654\uB098 \uD558\uB294 \uC0DD\uAC01\uC774 \uB4ED\uB2C8\uB2E4.</li></ul><h2 id="\u110C\u1161\u1105\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u110C\u1161\u1105\u1161\u1100\u1175" aria-hidden="true">#</a> \uC790\uB77C\uAE30</h2><h3 id="\u1103\u1161\u11BC\u1109\u1175\u11AB\u110B\u1173\u11AB-\u1106\u1167\u11BE\u1102\u1167\u11AB\u110E\u1161" tabindex="-1"><a class="header-anchor" href="#\u1103\u1161\u11BC\u1109\u1175\u11AB\u110B\u1173\u11AB-\u1106\u1167\u11BE\u1102\u1167\u11AB\u110E\u1161" aria-hidden="true">#</a> \uB2F9\uC2E0\uC740 \uBA87\uB144\uCC28?</h3><h4 id="\u1100\u1167\u11BC\u1105\u1167\u11A8-\u1100\u1173-\u1100\u1167\u11AB\u1103\u1175\u11AF-\u1109\u116E-\u110B\u1165\u11B9\u1102\u1173\u11AB-\u1106\u116E\u1100\u1165\u110B\u116E\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1100\u1167\u11BC\u1105\u1167\u11A8-\u1100\u1173-\u1100\u1167\u11AB\u1103\u1175\u11AF-\u1109\u116E-\u110B\u1165\u11B9\u1102\u1173\u11AB-\u1106\u116E\u1100\u1165\u110B\u116E\u11B7" aria-hidden="true">#</a> \uACBD\uB825, \uADF8 \uACAC\uB51C \uC218 \uC5C6\uB294 \uBB34\uAC70\uC6C0</h4><p>\uADF8\uB7F0\uB370 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAE30\uC220\uC790\uC758 \uB4F1\uAE09\uC774\uB77C\uB294 \uAC83\uC774, \uAC89\uC73C\uB85C\uB294 \uAE30\uC220\uC790\uACA9\uC774\uB098 \uD559\uB825\uC5D0 \uACBD\uD5D8\uC744 \uD568\uAED8 \uACE0\uB824\uD574 \uACB0\uC815\uB418\uB294 \uAC83 \uAC19\uC544 \uBCF4\uC774\uC9C0\uB9CC \uC0AC\uC2E4\uC0C1 &#39;\uACBD\uD5D8&#39;\uC774\uB77C\uB294 \uC694\uC18C\uAC00 \uAC00\uC7A5 \uACB0\uC815\uC801 \uC5ED\uD560\uC744 \uD569\uB2C8\uB2E4. ... \uC774\uB7F0 \uC81C\uB3C4 \uB54C\uBB38\uC5D0 \uC0AC\uB78C\uB4E4\uC740 \uB354\uB354\uC6B1 \uACBD\uB825\uC758 \uD2C0(\uC2EC\uB9AC\uD559\uC801 \uD504\uB808\uC784) \uC548\uC5D0\uC11C \uC0DD\uAC01\uD558\uAC8C \uB429\uB2C8\uB2E4. ... \uC800\uB294 \uC774 \uAE00\uC744 \uD1B5\uD574,</p><ol><li>\uACBD\uB825 \uC5F0\uCC28\uB77C\uB294 \uAC83\uC73C\uB85C\uBD80\uD130 \uC774 \uC0AC\uB78C\uC774 \uCD08\uAE09\uC778\uC9C0 \uC544\uB2CC\uC9C0 \uC815\uB3C4\uC758 \uC815\uBCF4\uB9CC \uAE30\uB300\uD560 \uC218 \uC788\uC73C\uBA70</li><li>\uCD08\uAE09\uC774 \uC544\uB2CC \uC0AC\uB78C\uB4E4\uC5D0 \uB300\uD574\uC11C\uB294 \uACBD\uB825 \uC5F0\uCC28\uAC00 \uC624\uD788\uB824 \uD63C\uB3D9\uC744 \uBD88\uB7EC\uC77C\uC73C\uD0A4\uB294 \uC798\uBABB\uB41C \uC815\uBCF4\uB85C \uC791\uC6A9\uD560 \uC218 \uC788\uACE0</li><li>\uACE0\uB85C \uACBD\uB825 \uC5F0\uCC28\uB85C \uCC44\uC6A9 \uC5EC\uBD80\uB098 \uC784\uAE08 \uC218\uC900\uC744 \uACB0\uC815\uD558\uB294 \uAC83\uC740 \uD310\uB2E8 \uD3B8\uC758\uC801\uC774\uACE0 \uAD00\uB8CC\uC8FC\uC758\uC801\uC774\uBA70 \uACB0\uACFC\uC801\uC73C\uB85C \uC870\uC9C1\uC5D0 \uC190\uD574\uB97C \uC904 \uC218 \uC788\uB294 \uBC29\uC2DD</li></ol><p>\uC774\uB77C\uACE0 \uC774\uC57C\uAE30\uD558\uB824\uACE0 \uD569\uB2C8\uB2E4.</p><h4 id="\u110C\u1175\u11A8\u110B\u116F\u11AB\u110B\u1173\u11AF-\u1108\u1169\u11B8\u110B\u1173\u11AF-\u1104\u1162-\u1106\u116E\u110B\u1165\u11BA\u110B\u1175-\u1100\u1173-\u1109\u1161\u1105\u1161\u11B7\u110B\u1174-\u1109\u1175\u11AF\u1105\u1167\u11A8\u110B\u1173\u11AF-\u1100\u1161\u110C\u1161\u11BC-\u110C\u1161\u11AF-\u110B\u1168\u110E\u1173\u11A8\u1112\u1161\u11AF\u1101\u1161" tabindex="-1"><a class="header-anchor" href="#\u110C\u1175\u11A8\u110B\u116F\u11AB\u110B\u1173\u11AF-\u1108\u1169\u11B8\u110B\u1173\u11AF-\u1104\u1162-\u1106\u116E\u110B\u1165\u11BA\u110B\u1175-\u1100\u1173-\u1109\u1161\u1105\u1161\u11B7\u110B\u1174-\u1109\u1175\u11AF\u1105\u1167\u11A8\u110B\u1173\u11AF-\u1100\u1161\u110C\u1161\u11BC-\u110C\u1161\u11AF-\u110B\u1168\u110E\u1173\u11A8\u1112\u1161\u11AF\u1101\u1161" aria-hidden="true">#</a> \uC9C1\uC6D0\uC744 \uBF51\uC744 \uB54C \uBB34\uC5C7\uC774 \uADF8 \uC0AC\uB78C\uC758 \uC2E4\uB825\uC744 \uAC00\uC7A5 \uC798 \uC608\uCE21\uD560\uAE4C?</h4><p>...\uB294 \uCC44\uC6A9 \uC2DC \uAC00\uC7A5 \uD6A8\uACFC\uC801\uC778 \uC608\uCE21\uBCC0\uC218\uAC00 \uBB34\uC5C7\uC774\uB0D0\uC5D0 \uB300\uD574 \uC5F0\uAD6C\uD588\uC2B5\uB2C8\uB2E4. 0\uC5D0 \uAC00\uAE4C\uC6B0\uBA74 \uC0C1\uAD00\uC131\uC774 \uC5C6\uB2E4\uACE0 \uB9D0\uD558\uACE0, 1\uC774\uB098 -1\uC5D0 \uAC00\uAE4C\uC6B0\uBA74 \uC0C1\uAD00\uC131\uC774 \uB192\uB2E4\uACE0 \uD569\uB2C8\uB2E4. \uD1B5\uC0C1 0.5\uB97C \uB118\uC73C\uBA74 \uAC15\uD55C \uD6A8\uACFC\uAC00 \uC788\uB2E4\uACE0 \uD558\uACE0 0.2\uC5D0\uC11C 0.5 \uC0AC\uC774\uB294 \uC911\uAC04\uC815\uB3C4\uB77C\uACE0 \uD558\uBA70, 0.2 \uC774\uD558\uB294 \uC57D\uD55C \uD6A8\uACFC\uB77C\uACE0 \uD569\uB2C8\uB2E4.</p><p>\uACBD\uB825 \uC5F0\uCC28\uC758 \uC0C1\uAD00\uC131\uC740 0.18, \uD559\uB825\uC758 \uC0C1\uAD00\uC131\uC740 0.10\uC785\uB2C8\uB2E4. \uAD00\uC2EC\uC0AC\uC870\uCC28\uB3C4 \uC9C1\uBB34 \uC131\uACFC\uC640 \uC0C1\uAD00\uC131\uC774 0.10\uC774 \uB418\uB294 \uC218\uC900\uC785\uB2C8\uB2E4.</p><p>\uADF8\uB807\uB2E4\uBA74 \uC5B4\uB5A4 \uAC83\uB4E4\uC774 \uC0C1\uAD00\uC131\uC774 \uB192\uC558\uC744\uAE4C\uC694? \uC791\uC5C5 \uC0D8\uD50C \uD14C\uC2A4\uD2B8(\uC2E4\uC81C\uB85C \uCC44\uC6A9 \uD6C4 \uD574\uC57C \uD560 \uC791\uC5C5\uC758 \uC77C\uBD80\uB97C \uD574\uBCF4\uB294 \uD14C\uC2A4\uD2B8)\uAC00 0.54, \uC544\uC774\uD050\uAC00 0.51\uC774\uC5C8\uC2B5\uB2C8\uB2E4. \uC131\uC2E4\uC131\uC774\uB098 \uAF3C\uAF3C\uD55C \uAC19\uC740 \uC131\uACA9 \uD14C\uC2A4\uD2B8\uB3C4 0.41\uC774\uB098 0.31 \uC815\uB3C4\uC758 \uC0C1\uAD00\uC131\uC774 \uC788\uC5C8\uC2B5\uB2C8\uB2E4. \uB808\uD37C\uB7F0\uC2A4 \uCCB4\uD06C\uB3C4 0.26\uC73C\uB85C \uC5F0\uCC28\uB4E4\uC758 \uC0C1\uAD00\uC131\uBCF4\uB2E4 \uB192\uC558\uC2B5\uB2C8\uB2E4.</p><p>\uADF8\uB807\uB2E4\uACE0 \uC5F0\uCC28\uAC00 \uC644\uC804\uD788 \uC758\uBBF8\uAC00 \uC5C6\uB294 \uAC83\uC740 \uC544\uB2C8\uC5C8\uC2B5\uB2C8\uB2E4. \uACBD\uB825\uC774 \uC5BC\uB9C8 \uB418\uC9C0 \uC54A\uC558\uC744 \uB584 \uBA87 \uB144\uAC04\uC740 \uC5F0\uCC28\uC758 \uC0C1\uAD00\uC131\uC774 \uAF64 \uB192\uC740 \uD3B8\uC785\uB2C8\uB2E4.</p><h4 id="\u110C\u116E\u11BC\u110B\u116D\u1112\u1161\u1103\u1161\u1100\u1169-\u1109\u1162\u11BC\u1100\u1161\u11A8\u1112\u1161\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1175-\u110C\u116E\u11BC\u110B\u116D\u1112\u1161\u110C\u1175-\u110B\u1161\u11AD\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u110C\u116E\u11BC\u110B\u116D\u1112\u1161\u1103\u1161\u1100\u1169-\u1109\u1162\u11BC\u1100\u1161\u11A8\u1112\u1161\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1175-\u110C\u116E\u11BC\u110B\u116D\u1112\u1161\u110C\u1175-\u110B\u1161\u11AD\u1103\u1161" aria-hidden="true">#</a> \uC911\uC694\uD558\uB2E4\uACE0 \uC0DD\uAC01\uD558\uB294 \uAC83\uC774 \uC911\uC694\uD558\uC9C0 \uC54A\uB2E4</h4><p>\uC608\uB97C \uB4E4\uBA74 \uACBD\uB825\uC744 \uC9C0\uB098\uCE58\uAC8C \uC911\uC694\uD558\uAC8C \uC5EC\uAE30\uB294 \uD68C\uC0AC\uAC00 \uB9CE\uC2B5\uB2C8\uB2E4. \uB3D9\uC2DC\uC5D0 \uD611\uB825 \uB2A5\uB825\uC744 \uC9C0\uB098\uCE58\uAC8C \uB4F1\uD55C\uC2DC\uD558\uB294 \uD68C\uC0AC\uAC00 \uB9CE\uC558\uC2B5\uB2C8\uB2E4.</p><p>\uCD5C\uC18C\uD55C\uB3C4\uC758 \uACBD\uB825 \uC218\uC900\uB9CC \uB118\uACBC\uC73C\uBA74 \uC624\uD788\uB824 \uBA87 \uB144 \uC77C\uD588\uB294\uC9C0\uB294 \uBAA8\uB974\uB294 \uAC83\uC774 \uB354 \uB0AB\uB2E4\uACE0 \uC0DD\uAC01\uD558\uACE0\uC694. \uC2E4\uC81C \uC791\uC5C5\uC744 \uD574\uBCF4\uB3C4\uB85D \uD558\uB294 \uC791\uC5C5 \uC0D8\uD50C \uD14C\uC2A4\uD2B8, \uC2E4\uC81C \uC5C5\uBB34\uB97C \uC8FC\uACE0 \uC2DC\uD5D8\uC801\uC73C\uB85C \uC9E7\uC740 \uAE30\uAC04 \uB3D9\uC548 \uC77C\uC744 \uD574\uBCF4\uAC8C \uD558\uB294 \uAC83 \uB4F1\uC744 \uAD8C\uD569\uB2C8\uB2E4.</p><h4 id="\u110C\u1161\u11AF-\u1108\u1169\u11B8\u1102\u1173\u11AB-\u1100\u1165\u11BA-\u110B\u1175\u1109\u1161\u11BC\u110B\u1173\u1105\u1169-\u110C\u116E\u11BC\u110B\u116D\u1112\u1161\u11AB-\u1100\u1165\u11BA-\u{1F6A7}" tabindex="-1"><a class="header-anchor" href="#\u110C\u1161\u11AF-\u1108\u1169\u11B8\u1102\u1173\u11AB-\u1100\u1165\u11BA-\u110B\u1175\u1109\u1161\u11BC\u110B\u1173\u1105\u1169-\u110C\u116E\u11BC\u110B\u116D\u1112\u1161\u11AB-\u1100\u1165\u11BA-\u{1F6A7}" aria-hidden="true">#</a> \uC798 \uBF51\uB294 \uAC83 \uC774\uC0C1\uC73C\uB85C \uC911\uC694\uD55C \uAC83 \u{1F6A7}</h4><h4 id="\u1100\u1162\u1107\u1161\u11AF\u110C\u1161\u1103\u1173\u11AF\u110B\u1175-\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1175\u11BB\u1102\u1173\u11AB-\u1100\u1165\u11BA-\u{1F6A7}" tabindex="-1"><a class="header-anchor" href="#\u1100\u1162\u1107\u1161\u11AF\u110C\u1161\u1103\u1173\u11AF\u110B\u1175-\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1175\u11BB\u1102\u1173\u11AB-\u1100\u1165\u11BA-\u{1F6A7}" aria-hidden="true">#</a> \uAC1C\uBC1C\uC790\uB4E4\uC774 \uD560 \uC218 \uC788\uB294 \uAC83 \u{1F6A7}</h4><h3 id="\u110C\u1161\u1100\u1175\u1100\u1168\u1107\u1161\u11AF\u110B\u1173\u11AB-\u1107\u1169\u11A8\u1105\u1175\u1105\u1169-\u1103\u1169\u11AF\u110B\u1161\u110B\u1169\u11AB\u1103\u1161-\u{1F6A7}" tabindex="-1"><a class="header-anchor" href="#\u110C\u1161\u1100\u1175\u1100\u1168\u1107\u1161\u11AF\u110B\u1173\u11AB-\u1107\u1169\u11A8\u1105\u1175\u1105\u1169-\u1103\u1169\u11AF\u110B\u1161\u110B\u1169\u11AB\u1103\u1161-\u{1F6A7}" aria-hidden="true">#</a> \uC790\uAE30\uACC4\uBC1C\uC740 \uBCF5\uB9AC\uB85C \uB3CC\uC544\uC628\uB2E4 \u{1F6A7}</h3><h4 id="\u1107\u1169\u11A8\u1105\u1175\u110B\u1174-\u1107\u1175\u1106\u1175\u11AF" tabindex="-1"><a class="header-anchor" href="#\u1107\u1169\u11A8\u1105\u1175\u110B\u1174-\u1107\u1175\u1106\u1175\u11AF" aria-hidden="true">#</a> \uBCF5\uB9AC\uC758 \uBE44\uBC00</h4><blockquote><p>&quot;\uC870\uC9C1\uC5D0\uB294 \uC138 \uAC00\uC9C0 \uCC28\uC6D0\uC758 \uC791\uC5C5\uC774 \uC788\uB2E4&quot;\uACE0 \uCEF4\uD4E8\uD130 \uC120\uAD6C\uC790\uC774\uC790 \uB9C8\uC6B0\uC2A4 \uBC1C\uBA85\uAC00\uC778 \uB354\uAE00\uB77C\uC2A4 \uC5E5\uAC94\uBC14\uD2B8\uAC00 \uB9D0\uD588\uB2E4.</p><p>A \uC791\uC5C5\uC740 \uAC89\uC73C\uB85C \uAC00\uC7A5 \uC798 \uB4DC\uB7EC\uB098\uB294 \uC218\uC900\uC73C\uB85C, \uD55C \uD68C\uC0AC\uC758 \uC0AC\uB78C\uACFC \uC790\uC6D0\uC758 \uB300\uBD80\uBD84\uC740 \uC774 \uC218\uC900\uC5D0 \uCD08\uC810\uC774 \uB9DE\uCDB0\uC838 \uC788\uB2E4. \uADF8 \uD68C\uC0AC\uC758 \uC0AC\uB78C\uACE0 \uC790\uC6D0\uC758 \uB300\uBD80\uBD84\uC740 \uC774 \uC218\uC900\uC5D0 \uCD08\uC810\uC774 \uB9DE\uCDB0\uC838 \uC788\uB2E4.</p><p>\uD558\uC9C0\uB9CC \uB2E4\uC74C \uC218\uC900\uC778 B \uC791\uC5C5 \uC5C6\uC774\uB294 \uD6A8\uACFC\uC801\uC778 A \uC791\uC5C5\uC740 \uBD88\uAC00\uB2A5\uD560 \uAC83\uC774\uB2E4. B \uC791\uC5C5\uC740 \uD68C\uC0AC\uAC00 \uC790\uC2E0\uC758 \uC81C\uD488\uACFC \uC11C\uBE44\uC2A4\uB97C \uAC1C\uBC1C, \uC0DD\uC0B0, \uD310\uB9E4\uD558\uB294 \uAC78 \uAC00\uB2A5\uCF00 \uD574\uC8FC\uB294 \uC2DC\uC2A4\uD15C\uACFC \uD504\uB85C\uC138\uC2A4\uB97C \uC124\uACC4\uD558\uB294 \uAC83\uACFC \uAD00\uB828\uC774 \uC788\uB2E4.</p><p>\uD558\uC9C0\uB9CC \uAC00\uC7A5 \uBBF8\uBB18\uD558\uACE0 \uB610 \uC7A0\uC7AC\uC801\uC73C\uB85C \uAC00\uC7A5 \uC601\uD5A5\uB825\uC774 \uD070 \uAC83\uC740 C \uC791\uC5C5\uC73C\uB85C, \uC774\uB294 \uC6B0\uB9AC\uC758 \uC0AC\uACE0\uBC29\uC2DD\uACFC \uC0C1\uD638 \uC791\uC6A9 \uBC29\uC2DD\uC744 \uAC1C\uC120\uD55C\uB2E4. \uAD81\uADF9\uC801\uC73C\uB85C\uB294 C \uC791\uC5C5\uC758 \uD488\uC9C8\uC774 \uC6B0\uB9AC\uAC00 \uC124\uACC4\uD558\uB294 \uC2DC\uC2A4\uD15C\uACFC \uD504\uB85C\uC138\uC2A4\uC758 \uD488\uC9C8\uC744 \uACB0\uC815\uC9D3\uACE0, \uB098\uC544\uAC00 \uC6B0\uB9AC\uAC00 \uC81C\uACF5\uD558\uB294 \uC81C\uD488\uACFC \uC11C\uBE44\uC2A4\uC758 \uD488\uC9C8\uC744 \uACB0\uC815\uC9D3\uB294\uB2E4.</p></blockquote><p>\uBCF4\uD1B5 \uACBD\uC601\uD559\uC5D0\uC11C\uB294 \uB354\uD558\uB294 \uC870\uC9C1\uC744 \uC791\uC5C5 \uADF8\uB8F9\uC774\uB77C\uACE0 \uD558\uACE0 \uACF1\uD558\uB294 \uC870\uC9C1\uC744 \uD300\uC774\uB77C\uACE0 \uAD6C\uBD84\uD569\uB2C8\uB2E4. \uC791\uC5C5 \uADF8\uB8F9\uC740 \uC8FC\uC5B4\uC9C4 \uC77C\uC744 \uC0AC\uB78C \uC22B\uC790\uC5D0 \uB9DE\uAC8C \uB098\uB220\uC8FC\uACE0 \uAC01\uC790 \uC815\uD574\uC9C4 \uC77C\uC744 \uD558\uB294 \uD615\uD0DC\uB97C \uB9D0\uD569\uB2C8\uB2E4. \uC11C\uB85C \uAD50\uB958\uD560 \uD544\uC694\uAC00 \uC5C6\uC2B5\uB2C8\uB2E4. \uBC18\uBA74\uC5D0 \uD300\uC740 \uC77C\uC744 \uC0C1\uD638 \uD611\uB825\uC801\uC73C\uB85C \uC9C4\uD589\uD569\uB2C8\uB2E4.</p><ul><li>\uADF8\uB9AC\uACE0 \uC870\uC9C1\uC758 \uD6A8\uACFC\uC131\uC744 \uAC00\uC7A5 \uC798 \uC608\uCE21\uD558\uB294 \uBCC0\uC218\uB294 \uB3D9\uB8CC \uCF54\uCE6D\uC774\uB77C\uACE0 \uD569\uB2C8\uB2E4. \uC11C\uB85C \uC5C5\uBB34\uC801\uC73C\uB85C \uB3C4\uC6C0\uC744 \uC8FC\uACE0\uBC1B\uB294 \uAC78 \uB9D0\uD558\uC8E0. \uC774 \uB3D9\uB8CC \uCF54\uCE6D\uACFC \uD37C\uD3EC\uBA3C\uC2A4 \uAC04\uC758 \uC0C1\uAD00\uACC4\uC218\uB294 0.82\uC785\uB2C8\uB2E4.</li></ul><p>\uC7A0\uC790\uB294 \uC2DC\uAC04\uC744 \uC904\uC774\uB294 \uAC83\uC774 \uB354\uD558\uAE30\uC801 \uC0AC\uACE0\uB77C\uBA74, \uC9D1\uB2E8\uC758 \uC9C0\uB2A5\uC744 \uB192\uC774\uB294 \uAC83\uC740 \uACF1\uD558\uAE30\uC801 \uC0AC\uACE0\uC785\uB2C8\uB2E4.</p><p>\uADF8\uB0E5 \uC77C\uD558\uB294 \uC2DC\uAC04\uC744 \uB298\uB9AC\uB294 \uAC83\uC740 \uC791\uC5C5\uB7C9\uC744 \uB298\uB9AC\uB294 \uAC83\uC5D0 \uC9C0\uB098\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.</p><p>A \uC791\uC5C5\uC744 \uAC1C\uC120\uD558\uB824\uBA74 \uB450 \uAC00\uC9C0 \uC9C8\uBB38\uC744 \uD574 \uBD10\uC57C \uD569\uB2C8\uB2E4. \uCCAB \uBC88\uC9F8\uB294 \uC5B4\uB5BB\uAC8C \uD558\uBA74 \uB354\uD558\uAE30\uBCF4\uB2E4 \uACF1\uD558\uAE30\uB97C \uD560 \uC218 \uC788\uC744 \uAC83\uC778\uAC00\uC785\uB2C8\uB2E4. \uB450 \uBC88\uC9F8\uB294 \uC5B4\uB5BB\uAC8C \uD574\uC57C \uACF1\uD558\uB294 \uBE44\uC728(\uC774\uC790\uC728)\uC744 \uB192\uC77C \uC218 \uC788\uB294\uAC00 \uD639\uC740 \uC774\uC790 \uC801\uC6A9 \uC8FC\uAE30(1\uB144\uC5D0 \uD55C \uBC88 \uB300\uC2E0\uC5D0 1\uB2EC\uC5D0 \uD55C\uBC88)\uB97C \uC9E7\uAC8C \uD560 \uC218 \uC788\uB294\uAC00\uC785\uB2C8\uB2E4.</p><ul><li>\uC790\uC2E0\uC774 \uC774\uBBF8 \uAC16\uACE0 \uC788\uB294 \uAC83\uB4E4\uC744 \uC798 \uD65C\uC6A9\uD558\uB77C</li><li>\uC678\uBD80 \uBB3C\uC9C8\uC744 \uCCB4\uD654\uD558\uB77C</li><li>\uC790\uC2E0\uC744 \uAC1C\uC120\uD558\uB294 \uD504\uB85C\uC138\uC2A4\uC5D0 \uB300\uD574 \uC0DD\uAC01\uD574 \uBCF4\uB77C <ul><li>\uC608\uCEE8\uB300 \uB098\uC758 A \uC791\uC5C5\uC744 \uB418\uB3CC\uC544\uBCF4\uB294 \uD68C\uACE0/\uBC18\uC131 \uD65C\uB3D9\uC744 \uC8FC\uAE30\uC801\uC73C\uB85C \uD558\uB294 \uD504\uB85C\uC138\uC2A4\uB97C \uB9CC\uB4E4\uC5B4\uB77C(C \uC791\uC5C5).</li><li>\uB098\uB97C \uAC1C\uC120\uD558\uB294 \uACFC\uC815(B \uC791\uC5C5)\uC744 \uC5B4\uB5BB\uAC8C \uD558\uBA74 \uAC1C\uC120\uD560 \uC218 \uC788\uC744\uC9C0 \uACE0\uBBFC\uD558\uB77C.</li></ul></li><li>\uD53C\uB4DC\uBC31\uC744 \uC790\uC8FC \uBC1B\uC544\uB77C <ul><li>\uC77C\uCC0D, \uADF8\uB9AC\uACE0 \uC790\uC8FC \uC2E4\uD328\uD558\uB77C. \uC2E4\uD328\uC5D0\uC11C \uD559\uC2B5\uD558\uB77C.</li></ul></li><li>\uC790\uC2E0\uC758 \uB2A5\uB825\uC744 \uB192\uC5EC\uC8FC\uB294 \uB3C4\uAD6C\uC640 \uD658\uACBD\uC744 \uC810\uC9C4\uC801\uC73C\uB85C \uB9CC\uB4E4\uC5B4\uB77C</li></ul><h3 id="\u1112\u1161\u11A8\u1109\u1173\u11B8-\u1111\u1173\u1105\u1166\u110B\u1175\u11B7\u1100\u116A-\u1109\u1175\u11AF\u1112\u1162\u11BC-\u1111\u1173\u1105\u1166\u110B\u1175\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1112\u1161\u11A8\u1109\u1173\u11B8-\u1111\u1173\u1105\u1166\u110B\u1175\u11B7\u1100\u116A-\u1109\u1175\u11AF\u1112\u1162\u11BC-\u1111\u1173\u1105\u1166\u110B\u1175\u11B7" aria-hidden="true">#</a> \uD559\uC2B5 \uD504\uB808\uC784\uACFC \uC2E4\uD589 \uD504\uB808\uC784</h3><p>\uD55C \uADF8\uB8F9\uC758 \uC544\uC774\uB4E4\uC5D0\uAC8C\uB294 \uC2E4\uD589 \uD504\uB808\uC784\uC744 \uAC16\uAC8C \uD569\uB2C8\uB2E4. &quot;\uC5EC\uB7EC\uBD84\uC774 \uC5BC\uB9C8\uB098 \uADF8\uB9BC\uC744 \uC798 \uADF8\uB9AC\uB294\uC9C0 \uBCF4\uACE0\uC790 \uD558\uB294 \uAC81\uB2C8\uB2E4. \uC5EC\uB7EC\uBD84\uC758 \uCC3D\uC758\uC131\uC744 \uCE21\uC815\uD574 \uBCF4\uB824\uACE0 \uD569\uB2C8\uB2E4. \uC810\uC218\uB97C \uB9E4\uAE38 \uAC70\uC5D0\uC694. ...&quot; \uB2E4\uB978 \uADF8\uB8F9 \uC544\uC774\uB4E4\uC5D0\uAC8C\uB294 \uD559\uC2B5 \uD504\uB808\uC784\uC744 \uAC16\uAC8C \uD569\uB2C8\uB2E4. &quot;\uB0B4\uAC00 \uC548 \uADF8\uB824 \uBCF4\uC558\uB358 \uBC29\uC2DD\uB4E4\uC744 \uC2E4\uD5D8\uD574 \uBCF4\uB294 \uC2DC\uAC04\uC774\uC5D0\uC694. \uC5EC\uB7EC \uAC00\uC9C0 \uBC29\uC2DD\uC73C\uB85C \uC2E4\uD5D8\uD574 \uBCF4\uC138\uC694.&quot; ... \uC2E4\uD589 \uD504\uB808\uC784\uC5D0\uC11C\uB294 &#39;\uC798\uD558\uAE30&#39;\uC5D0 \uCD08\uC810\uC744 \uB9DE\uCD94\uAC8C \uD558\uACE0, \uD559\uC2B5 \uD504\uB808\uC784\uC5D0\uC11C\uB294 &#39;\uC790\uB77C\uAE30&#39;\uC5D0 \uCD08\uC810\uC744 \uB9DE\uCD94\uAC8C \uD569\uB2C8\uB2E4.</p><p>\uC5EC\uAE30\uC5D0\uC11C \uB9D0\uD558\uB294 \uC2E4\uD589 \uD504\uB808\uC784\uC740 \uC0AC\uB78C\uB4E4\uC774 \uD604\uC7AC \uC8FC\uC5B4\uC9C4 \uACFC\uC5C5\uC774 \uBB54\uAC00 \uC88B\uC740 \uC131\uACFC\uB97C \uB0B4\uB294 \uAC78\uB85C \uC0DD\uAC01\uD558\uB294 \uD2C0\uC744 \uB9D0\uD569\uB2C8\uB2E4. \uD559\uC2B5 \uD504\uB808\uC784\uC740 \uD604\uC7AC \uC8FC\uC5B4\uC9C4 \uACFC\uC5C5\uC774 \uB0B4\uAC00 \uC5BC\uB9C8\uB098 \uBC30\uC6B0\uB290\uB0D0\uB85C \uC5EC\uAE30\uAC8C \uB418\uB294 \uD2C0\uC744 \uB9D0\uD569\uB2C8\uB2E4.</p><p>\uD604\uC7AC \uC0C1\uD669 \uC790\uCCB4\uAC00 \uC5B4\uB835\uC9C0 \uC54A\uB0D0. \uC5C5\uBB34\uD558\uBA74\uC11C \uD559\uC2B5\uC774 \uC911\uC694\uD558\uB2E4\uB294 \uC0DD\uAC01\uC744 \uAC16\uAE30\uAC00 \uC5B4\uB835\uC9C0 \uC54A\uB0D0.</p><p>\uC9C0\uAE08 \uC790\uC2E0\uC758 \uC0C1\uD669 &#39;\uB54C\uBB38\uC5D0&#39; \uD559\uC2B5 \uD504\uB808\uC784\uC744 \uAC16\uB294 \uAC83\uC774 \uD798\uB4E4\uB2E4\uB294 \uC0DD\uAC01\uC774 \uB4E0\uB2E4\uBA74, \uC774 \uC6B0\uC8FC \uC5B4\uB518\uAC00\uC758 \uB204\uAD6C\uB294 \uBE44\uC2B7\uD55C \uC0C1\uD669 &#39;\uB355\uBD84\uC5D0&#39; \uD559\uC2B5 \uD504\uB808\uC784\uC744 \uAC00\uC9C8 \uC218 \uC788\uC5C8\uB2E4\uACE0 \uC0DD\uAC01\uD558\uACE0 \uC788\uB2E4\uACE0 \uC0C1\uC0C1\uD574 \uBCF4\uBA74 \uC5B4\uB5A8\uAE4C\uC694?</p><h3 id="\u1100\u1161\u110C\u1161\u11BC-\u1112\u1161\u11A8\u1109\u1173\u11B8\u1112\u1161\u1100\u1175-\u1112\u1175\u11B7\u1103\u1173\u11AB-\u110C\u1175\u11A8\u110B\u1165\u11B8\u110B\u1175-\u1109\u1161\u11AF\u110B\u1161\u1102\u1161\u11B7\u1102\u1173\u11AB\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1100\u1161\u110C\u1161\u11BC-\u1112\u1161\u11A8\u1109\u1173\u11B8\u1112\u1161\u1100\u1175-\u1112\u1175\u11B7\u1103\u1173\u11AB-\u110C\u1175\u11A8\u110B\u1165\u11B8\u110B\u1175-\u1109\u1161\u11AF\u110B\u1161\u1102\u1161\u11B7\u1102\u1173\u11AB\u1103\u1161" aria-hidden="true">#</a> \uAC00\uC7A5 \uD559\uC2B5\uD558\uAE30 \uD798\uB4E0 \uC9C1\uC5C5\uC774 \uC0B4\uC544\uB0A8\uB294\uB2E4</h3><h4 id="\u1112\u1161\u11A8\u1109\u1173\u11B8\u110B\u1166-\u110B\u1172\u1105\u1175\u1112\u1161\u11AB-\u110C\u1169\u1100\u1165\u11AB-\u1107\u116E\u11AF\u1105\u1175\u1112\u1161\u11AB-\u110C\u1169\u1100\u1165\u11AB" tabindex="-1"><a class="header-anchor" href="#\u1112\u1161\u11A8\u1109\u1173\u11B8\u110B\u1166-\u110B\u1172\u1105\u1175\u1112\u1161\u11AB-\u110C\u1169\u1100\u1165\u11AB-\u1107\u116E\u11AF\u1105\u1175\u1112\u1161\u11AB-\u110C\u1169\u1100\u1165\u11AB" aria-hidden="true">#</a> \uD559\uC2B5\uC5D0 \uC720\uB9AC\uD55C \uC870\uAC74, \uBD88\uB9AC\uD55C \uC870\uAC74</h4><h4 id="\u110F\u1165\u11B7\u1111\u1172\u1110\u1165\u1105\u1169-\u1103\u1162\u110E\u1166\u1103\u116C\u1100\u1175-\u1112\u1175\u11B7\u1103\u1173\u11AB-\u110B\u1175\u11AF" tabindex="-1"><a class="header-anchor" href="#\u110F\u1165\u11B7\u1111\u1172\u1110\u1165\u1105\u1169-\u1103\u1162\u110E\u1166\u1103\u116C\u1100\u1175-\u1112\u1175\u11B7\u1103\u1173\u11AB-\u110B\u1175\u11AF" aria-hidden="true">#</a> \uCEF4\uD4E8\uD130\uB85C \uB300\uCCB4\uB418\uAE30 \uD798\uB4E0 \uC77C</h4><h4 id="\u1106\u116E\u110B\u1165\u11BA\u110B\u1166-\u110C\u1175\u11B8\u110C\u116E\u11BC\u1112\u1161\u11AF-\u1100\u1165\u11BA\u110B\u1175\u11AB\u1100\u1161" tabindex="-1"><a class="header-anchor" href="#\u1106\u116E\u110B\u1165\u11BA\u110B\u1166-\u110C\u1175\u11B8\u110C\u116E\u11BC\u1112\u1161\u11AF-\u1100\u1165\u11BA\u110B\u1175\u11AB\u1100\u1161" aria-hidden="true">#</a> \uBB34\uC5C7\uC5D0 \uC9D1\uC911\uD560 \uAC83\uC778\uAC00</h4><h3 id="\u1103\u1161\u11AF\u110B\u1175\u11AB\u110B\u1175-\u1103\u116C\u1102\u1173\u11AB-\u1107\u1175\u1100\u1167\u11AF" tabindex="-1"><a class="header-anchor" href="#\u1103\u1161\u11AF\u110B\u1175\u11AB\u110B\u1175-\u1103\u116C\u1102\u1173\u11AB-\u1107\u1175\u1100\u1167\u11AF" aria-hidden="true">#</a> \uB2EC\uC778\uC774 \uB418\uB294 \uBE44\uACB0</h3><h4 id="\u1103\u1169\u11BC\u1100\u1175\u1100\u1161-\u1107\u116E\u110C\u1169\u11A8\u1112\u1161\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1103\u1169\u11BC\u1100\u1175\u1100\u1161-\u1107\u116E\u110C\u1169\u11A8\u1112\u1161\u1103\u1161" aria-hidden="true">#</a> \uB3D9\uAE30\uAC00 \uBD80\uC871\uD558\uB2E4</h4><h4 id="\u1111\u1175\u1103\u1173\u1107\u1162\u11A8\u110B\u1173\u11AF-\u110C\u1166\u1104\u1162-\u1107\u1161\u11AE\u110C\u1175-\u1106\u1169\u11BA\u1112\u1161\u11AB\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1111\u1175\u1103\u1173\u1107\u1162\u11A8\u110B\u1173\u11AF-\u110C\u1166\u1104\u1162-\u1107\u1161\u11AE\u110C\u1175-\u1106\u1169\u11BA\u1112\u1161\u11AB\u1103\u1161" aria-hidden="true">#</a> \uD53C\uB4DC\uBC31\uC744 \uC81C\uB54C \uBC1B\uC9C0 \uBABB\uD55C\uB2E4</h4><h3 id="\u1109\u116E\u1109\u1175\u11B8-\u1102\u1167\u11AB-\u1103\u1169\u11BC\u110B\u1161\u11AB-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u1100\u1161-\u110B\u1161\u11AB-\u1103\u116C\u1102\u1173\u11AB-\u1107\u1175\u1100\u1167\u11AF" tabindex="-1"><a class="header-anchor" href="#\u1109\u116E\u1109\u1175\u11B8-\u1102\u1167\u11AB-\u1103\u1169\u11BC\u110B\u1161\u11AB-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u1100\u1161-\u110B\u1161\u11AB-\u1103\u116C\u1102\u1173\u11AB-\u1107\u1175\u1100\u1167\u11AF" aria-hidden="true">#</a> \uC218\uC2ED \uB144 \uB3D9\uC548 \uC804\uBB38\uAC00\uAC00 \uC548 \uB418\uB294 \uBE44\uACB0</h3><h4 id="\u110C\u1165\u11AB\u1106\u116E\u11AB\u1109\u1165\u11BC-\u1112\u1167\u11BC\u1109\u1165\u11BC\u110B\u1166\u1109\u1165-\u1110\u1161\u1103\u1161\u11BC\u1109\u1165\u11BC\u1100\u116A-\u1111\u1175\u1103\u1173\u1107\u1162\u11A8\u110B\u1174-\u110C\u116E\u11BC\u110B\u116D\u1109\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u110C\u1165\u11AB\u1106\u116E\u11AB\u1109\u1165\u11BC-\u1112\u1167\u11BC\u1109\u1165\u11BC\u110B\u1166\u1109\u1165-\u1110\u1161\u1103\u1161\u11BC\u1109\u1165\u11BC\u1100\u116A-\u1111\u1175\u1103\u1173\u1107\u1162\u11A8\u110B\u1174-\u110C\u116E\u11BC\u110B\u116D\u1109\u1165\u11BC" aria-hidden="true">#</a> \uC804\uBB38\uC131 \uD615\uC131\uC5D0\uC11C \uD0C0\uB2F9\uC131\uACFC \uD53C\uB4DC\uBC31\uC758 \uC911\uC694\uC131</h4><h4 id="\u1110\u1161\u1103\u1161\u11BC\u1109\u1165\u11BC\u1100\u116A-\u1111\u1175\u1103\u1173\u1107\u1162\u11A8\u110B\u1173\u11AF-\u1102\u1169\u11C1\u110B\u1175\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1110\u1161\u1103\u1161\u11BC\u1109\u1165\u11BC\u1100\u116A-\u1111\u1175\u1103\u1173\u1107\u1162\u11A8\u110B\u1173\u11AF-\u1102\u1169\u11C1\u110B\u1175\u1100\u1175" aria-hidden="true">#</a> \uD0C0\uB2F9\uC131\uACFC \uD53C\uB4DC\uBC31\uC744 \uB192\uC774\uAE30</h4><h3 id="\u1103\u1161\u11BC\u1109\u1175\u11AB\u110B\u1175-\u110C\u1166\u110C\u1161\u1105\u1175\u1100\u1165\u11AF\u110B\u1173\u11B7\u110B\u1175\u11AB-\u110B\u1175\u110B\u1172" tabindex="-1"><a class="header-anchor" href="#\u1103\u1161\u11BC\u1109\u1175\u11AB\u110B\u1175-\u110C\u1166\u110C\u1161\u1105\u1175\u1100\u1165\u11AF\u110B\u1173\u11B7\u110B\u1175\u11AB-\u110B\u1175\u110B\u1172" aria-hidden="true">#</a> \uB2F9\uC2E0\uC774 \uC81C\uC790\uB9AC\uAC78\uC74C\uC778 \uC774\uC720</h3><h4 id="\u110B\u1174\u1103\u1169\u110C\u1165\u11A8-\u1109\u116E\u1105\u1167\u11AB\u110B\u1174-\u1111\u1175\u11AF\u1109\u116E\u110C\u1169\u1100\u1165\u11AB-\u110C\u1165\u11A8\u110C\u1165\u11AF\u1112\u1161\u11AB-\u1102\u1161\u11AB\u110B\u1175\u1103\u1169" tabindex="-1"><a class="header-anchor" href="#\u110B\u1174\u1103\u1169\u110C\u1165\u11A8-\u1109\u116E\u1105\u1167\u11AB\u110B\u1174-\u1111\u1175\u11AF\u1109\u116E\u110C\u1169\u1100\u1165\u11AB-\u110C\u1165\u11A8\u110C\u1165\u11AF\u1112\u1161\u11AB-\u1102\u1161\u11AB\u110B\u1175\u1103\u1169" aria-hidden="true">#</a> \uC758\uB3C4\uC801 \uC218\uB828\uC758 \uD544\uC218\uC870\uAC74, \uC801\uC808\uD55C \uB09C\uC774\uB3C4</h4><h4 id="\u1109\u1175\u11AF\u1105\u1167\u11A8\u110B\u1175-\u1102\u1173\u11AF\u110C\u1175-\u110B\u1161\u11AD\u1102\u1173\u11AB-\u110B\u1175\u110B\u1172" tabindex="-1"><a class="header-anchor" href="#\u1109\u1175\u11AF\u1105\u1167\u11A8\u110B\u1175-\u1102\u1173\u11AF\u110C\u1175-\u110B\u1161\u11AD\u1102\u1173\u11AB-\u110B\u1175\u110B\u1172" aria-hidden="true">#</a> \uC2E4\uB825\uC774 \uB298\uC9C0 \uC54A\uB294 \uC774\uC720</h4><h4 id="\u110C\u1166\u110C\u1161\u1105\u1175\u1100\u1165\u11AF\u110B\u1173\u11B7\u110B\u1166\u1109\u1165-\u1107\u1165\u11BA\u110B\u1165\u1102\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u110C\u1166\u110C\u1161\u1105\u1175\u1100\u1165\u11AF\u110B\u1173\u11B7\u110B\u1166\u1109\u1165-\u1107\u1165\u11BA\u110B\u1165\u1102\u1161\u1100\u1175" aria-hidden="true">#</a> \uC81C\uC790\uB9AC\uAC78\uC74C\uC5D0\uC11C \uBC97\uC5B4\uB098\uAE30</h4><h4 id="\u110C\u1175\u1105\u116E\u1112\u1161\u11B7\u110B\u1173\u11AF-\u1102\u1173\u1101\u1175\u1102\u1173\u11AB-\u1100\u1167\u11BC\u110B\u116E-a1-\u1109\u1175\u11AF\u1105\u1167\u11A8-\u1102\u1161\u11BD\u110E\u116E\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u110C\u1175\u1105\u116E\u1112\u1161\u11B7\u110B\u1173\u11AF-\u1102\u1173\u1101\u1175\u1102\u1173\u11AB-\u1100\u1167\u11BC\u110B\u116E-a1-\u1109\u1175\u11AF\u1105\u1167\u11A8-\u1102\u1161\u11BD\u110E\u116E\u1100\u1175" aria-hidden="true">#</a> \uC9C0\uB8E8\uD568\uC744 \uB290\uB07C\uB294 \uACBD\uC6B0: a1 \uC2E4\uB825 \uB0AE\uCD94\uAE30</h4><h4 id="\u110C\u1175\u1105\u116E\u1112\u1161\u11B7\u110B\u1173\u11AF-\u1102\u1173\u1101\u1175\u1102\u1173\u11AB-\u1100\u1167\u11BC\u110B\u116E-a2-\u1102\u1161\u11AB\u110B\u1175\u1103\u1169-\u1102\u1169\u11C1\u110B\u1175\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u110C\u1175\u1105\u116E\u1112\u1161\u11B7\u110B\u1173\u11AF-\u1102\u1173\u1101\u1175\u1102\u1173\u11AB-\u1100\u1167\u11BC\u110B\u116E-a2-\u1102\u1161\u11AB\u110B\u1175\u1103\u1169-\u1102\u1169\u11C1\u110B\u1175\u1100\u1175" aria-hidden="true">#</a> \uC9C0\uB8E8\uD568\uC744 \uB290\uB07C\uB294 \uACBD\uC6B0: a2 \uB09C\uC774\uB3C4 \uB192\uC774\uAE30</h4><h4 id="\u1107\u116E\u11AF\u110B\u1161\u11AB\u1112\u1161\u11B7\u110B\u1173\u11AF-\u1102\u1173\u1101\u1175\u1102\u1173\u11AB-\u1100\u1167\u11BC\u110B\u116E-b2-\u1109\u1175\u11AF\u1105\u1167\u11A8-\u1102\u1169\u11C1\u110B\u1175\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1107\u116E\u11AF\u110B\u1161\u11AB\u1112\u1161\u11B7\u110B\u1173\u11AF-\u1102\u1173\u1101\u1175\u1102\u1173\u11AB-\u1100\u1167\u11BC\u110B\u116E-b2-\u1109\u1175\u11AF\u1105\u1167\u11A8-\u1102\u1169\u11C1\u110B\u1175\u1100\u1175" aria-hidden="true">#</a> \uBD88\uC548\uD568\uC744 \uB290\uB07C\uB294 \uACBD\uC6B0: b2 \uC2E4\uB825 \uB192\uC774\uAE30</h4><h4 id="\u1107\u116E\u11AF\u110B\u1161\u11AB\u1112\u1161\u11B7\u110B\u1173\u11AF-\u1102\u1173\u1101\u1175\u1102\u1173\u11AB-\u1100\u1167\u11BC\u110B\u116E-b1-\u1102\u1161\u11AB\u110B\u1175\u1103\u1169-\u1102\u1161\u11BD\u110E\u116E\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1107\u116E\u11AF\u110B\u1161\u11AB\u1112\u1161\u11B7\u110B\u1173\u11AF-\u1102\u1173\u1101\u1175\u1102\u1173\u11AB-\u1100\u1167\u11BC\u110B\u116E-b1-\u1102\u1161\u11AB\u110B\u1175\u1103\u1169-\u1102\u1161\u11BD\u110E\u116E\u1100\u1175" aria-hidden="true">#</a> \uBD88\uC548\uD568\uC744 \uB290\uB07C\uB294 \uACBD\uC6B0: b1 \uB09C\uC774\uB3C4 \uB0AE\uCD94\uAE30</h4><p><strong>\uD14C\uD2B8\uB9AC\uC2A4\uC758 \uD575\uC2EC\uC740 \uC0B4\uC544\uC788\uC73C\uBA74\uC11C\uB3C4 \uAC04\uB2E8\uD55C, \uC544\uAE30 \uBC84\uC804\uC758 \uD14C\uD2B8\uB9AC\uC2A4\uB97C \uB9CC\uB4DC\uB294 \uAC83\uC785\uB2C8\uB2E4.</strong></p><h4 id="\u1103\u1169\u11BC\u110C\u1165\u11A8\u110B\u1175\u11AB-\u1100\u1172\u11AB\u1112\u1167\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1103\u1169\u11BC\u110C\u1165\u11A8\u110B\u1175\u11AB-\u1100\u1172\u11AB\u1112\u1167\u11BC" aria-hidden="true">#</a> \uB3D9\uC801\uC778 \uADE0\uD615</h4><h4 id="\u1110\u1175\u11B7\u110C\u1161\u11BC\u110B\u1175-\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1175\u11BB\u1102\u1173\u11AB-\u110B\u1175\u11AF" tabindex="-1"><a class="header-anchor" href="#\u1110\u1175\u11B7\u110C\u1161\u11BC\u110B\u1175-\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1175\u11BB\u1102\u1173\u11AB-\u110B\u1175\u11AF" aria-hidden="true">#</a> \uD300\uC7A5\uC774 \uD560 \uC218 \uC788\uB294 \uC77C</h4><h4 id="\u110B\u1175\u1109\u1169\u1105\u116D\u11BC\u110B\u1174-\u110C\u1161\u1100\u1175-\u1112\u1167\u11A8\u1109\u1175\u11AB" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u1109\u1169\u1105\u116D\u11BC\u110B\u1174-\u110C\u1161\u1100\u1175-\u1112\u1167\u11A8\u1109\u1175\u11AB" aria-hidden="true">#</a> \uC774\uC18C\uB8E1\uC758 \uC790\uAE30 \uD601\uC2E0</h4><h3 id="\u110B\u1174\u1103\u1169\u110C\u1165\u11A8-\u1109\u116E\u1105\u1167\u11AB\u110B\u1174-\u110B\u1175\u11AF\u1109\u1161\u11BC\u110C\u1165\u11A8-\u110B\u1168\u1109\u1175" tabindex="-1"><a class="header-anchor" href="#\u110B\u1174\u1103\u1169\u110C\u1165\u11A8-\u1109\u116E\u1105\u1167\u11AB\u110B\u1174-\u110B\u1175\u11AF\u1109\u1161\u11BC\u110C\u1165\u11A8-\u110B\u1168\u1109\u1175" aria-hidden="true">#</a> \uC758\uB3C4\uC801 \uC218\uB828\uC758 \uC77C\uC0C1\uC801 \uC608\uC2DC</h3><h4 id="\u1109\u1175\u11AF\u1105\u1167\u11A8-\u110C\u1169\u110C\u1165\u11BC\u1112\u1161\u1100\u1175-a1-b2" tabindex="-1"><a class="header-anchor" href="#\u1109\u1175\u11AF\u1105\u1167\u11A8-\u110C\u1169\u110C\u1165\u11BC\u1112\u1161\u1100\u1175-a1-b2" aria-hidden="true">#</a> \uC2E4\uB825 \uC870\uC815\uD558\uAE30(a1, b2)</h4><h4 id="\u1102\u1161\u11AB\u110B\u1175\u1103\u1169-\u110C\u1169\u110C\u1165\u11AF\u1112\u1161\u1100\u1175-a2-b1" tabindex="-1"><a class="header-anchor" href="#\u1102\u1161\u11AB\u110B\u1175\u1103\u1169-\u110C\u1169\u110C\u1165\u11AF\u1112\u1161\u1100\u1175-a2-b1" aria-hidden="true">#</a> \uB09C\uC774\uB3C4 \uC870\uC808\uD558\uAE30(a2, b1)</h4><p>\uC77C\uBC18\uC801\uC73C\uB85C \uC81C\uAC00 \uC0C8\uB85C\uC6B4 \uAE30\uC220\uC744 \uCF54\uCE6D\uC5D0 \uC801\uC6A9\uD560 \uACBD\uC6B0 \uC774 \uB09C\uC774\uB3C4 \uC870\uC808\uC744 \uC801\uADF9\uC801\uC73C\uB85C, \uC810\uC9C4\uC801\uC73C\uB85C \uD558\uB294 \uAC83 \uAC19\uC2B5\uB2C8\uB2E4.</p><p>\uCC98\uC74C\uC5D0\uB294 \uD604\uC7AC \uC81C \uC790\uC2E0\uC5D0\uAC8C \uC801\uC6A9\uD574 \uD649\uB2C8\uB2E4. ... \uADF8 \uB2E4\uC74C\uC5D0\uB294 \uACFC\uAC70\uC758 \uD798\uB4E4\uAC70\uB098 \uC5B4\uB824\uC6E0\uB358 \uC0C1\uD669\uC744 \uB5A0\uC62C\uB824\uC11C \uADF8 \uB54C\uC758 \uC790\uC2E0\uC744 \uCF54\uCE6D\uD574 \uBD05\uB2C8\uB2E4. ... \uC774\uAC8C \uB418\uBA74 \uC2E4\uC81C\uB85C \uADF8 \uC0AC\uB78C\uACFC \uCF54\uCE6D\uC744 \uD574\uBD05\uB2C8\uB2E4. \uC774 \uB54C\uC5D0\uB294 \uBBF8\uB9AC \uC5B8\uAE09\uC744 \uD569\uB2C8\uB2E4.</p><h3 id="\u1111\u1173\u1105\u1169\u1100\u1173\u1105\u1162\u1106\u1175\u11BC-\u110B\u1165\u11AB\u110B\u1165-\u1107\u1162\u110B\u116E\u1100\u1175\u110B\u1174-\u1103\u1161\u11AF\u110B\u1175\u11AB" tabindex="-1"><a class="header-anchor" href="#\u1111\u1173\u1105\u1169\u1100\u1173\u1105\u1162\u1106\u1175\u11BC-\u110B\u1165\u11AB\u110B\u1165-\u1107\u1162\u110B\u116E\u1100\u1175\u110B\u1174-\u1103\u1161\u11AF\u110B\u1175\u11AB" aria-hidden="true">#</a> \uD504\uB85C\uADF8\uB798\uBC0D \uC5B8\uC5B4 \uBC30\uC6B0\uAE30\uC758 \uB2EC\uC778</h3><p>&#39;\uC778\uAC04&#39; \uC5ED\uC5D4\uC9C0\uB2C8\uC5B4\uB9C1 \uBC29\uBC95\uC744 \uC0AC\uC6A9\uD558\uACE0, \uB610 \uAC00\uB974\uCE58\uACE0 \uC788\uC2B5\uB2C8\uB2E4.</p><p>S \uB2D8\uC758 \uC5B4\uB5A4 \uC804\uBB38\uC131\uC744 \uB04C\uC5B4\uB0BC\uAE4C \uD558\uB2E4\uAC00 &#39;\uD504\uB85C\uADF8\uB798\uBC0D \uC5B8\uC5B4\uB97C \uBC30\uC6B0\uB294 \uC804\uBB38\uC131&#39;\uC744 \uD558\uAE30\uB85C \uD588\uC2B5\uB2C8\uB2E4.</p><h4 id="\u1110\u1172\u1110\u1169\u1105\u1175\u110B\u1165\u11AF\u110B\u1173\u11AF-\u110B\u1175\u11B0\u110B\u1173\u11AF-\u1104\u1162-\u1106\u116F\u11AF-\u1106\u1161\u11AB\u1103\u1173\u11AF\u110C\u1175-\u1109\u1162\u11BC\u1100\u1161\u11A8\u1112\u1161\u1100\u1169-\u110B\u1175\u11B0\u1102\u1173\u11AB\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1110\u1172\u1110\u1169\u1105\u1175\u110B\u1165\u11AF\u110B\u1173\u11AF-\u110B\u1175\u11B0\u110B\u1173\u11AF-\u1104\u1162-\u1106\u116F\u11AF-\u1106\u1161\u11AB\u1103\u1173\u11AF\u110C\u1175-\u1109\u1162\u11BC\u1100\u1161\u11A8\u1112\u1161\u1100\u1169-\u110B\u1175\u11B0\u1102\u1173\u11AB\u1103\u1161" aria-hidden="true">#</a> \uD29C\uD1A0\uB9AC\uC5BC\uC744 \uC77D\uC744 \uB54C \uBB58 \uB9CC\uB4E4\uC9C0 \uC0DD\uAC01\uD558\uACE0 \uC77D\uB294\uB2E4</h4><p>\uC801\uADF9\uC801 \uC77D\uAE30</p><p>\uCCAB \uBC88\uC9F8 \uBAA9\uD45C\uB85C \uC8FC\uB85C \uC0BC\uB294 \uD504\uB85C\uADF8\uB7A8\uC740 \uB2E8\uC5B4 \uAC1C\uC218 \uC138\uAE30 \uD504\uB85C\uADF8\uB7A8\uC774\uB77C\uACE0 \uD569\uB2C8\uB2E4.</p><h4 id="\u1100\u1169\u11BC\u1107\u116E\u1112\u1161\u11AF-\u1104\u1162-\u1111\u116D\u110C\u116E\u11AB-\u1105\u1161\u110B\u1175\u1107\u1173\u1105\u1165\u1105\u1175-\u1109\u1169\u1109\u1173\u110F\u1169\u1103\u1173\u1105\u1173\u11AF-\u110B\u1175\u11B0\u1102\u1173\u11AB\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1100\u1169\u11BC\u1107\u116E\u1112\u1161\u11AF-\u1104\u1162-\u1111\u116D\u110C\u116E\u11AB-\u1105\u1161\u110B\u1175\u1107\u1173\u1105\u1165\u1105\u1175-\u1109\u1169\u1109\u1173\u110F\u1169\u1103\u1173\u1105\u1173\u11AF-\u110B\u1175\u11B0\u1102\u1173\u11AB\u1103\u1161" aria-hidden="true">#</a> \uACF5\uBD80\uD560 \uB54C \uD45C\uC900 \uB77C\uC774\uBE0C\uB7EC\uB9AC \uC18C\uC2A4\uCF54\uB4DC\uB97C \uC77D\uB294\uB2E4</h4><p>\uC790\uC5F0 \uC5B8\uC5B4 \uAD50\uC721\uACFC\uB294 \uB2E4\uB974\uAC8C \uD504\uB85C\uADF8\uB798\uBC0D \uC5B8\uC5B4 \uAD50\uC721\uC5D0\uC11C\uB294 \uC77D\uAE30\uBCF4\uB2E4 \uC4F0\uAE30\uB97C \uB354 \uAC15\uC870\uD558\uB294 \uACBD\uD5A5\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uD504\uB85C\uADF8\uB798\uBC0D \uC5B8\uC5B4\uB97C \uAC00\uB974\uCE60 \uB54C \uC77D\uAE30\uB97C \uAD50\uC721\uD558\uB294 \uACBD\uC6B0\uB294 \uADF9\uD788 \uB4DC\uBB3C\uC8E0. \uD558\uC9C0\uB9CC \uD504\uB85C\uADF8\uB798\uBA38\uAC00 \uC2E4\uC81C\uB85C \uC5C5\uBB34\uB97C \uD560 \uB54C\uC5D0\uB294 \uCF54\uB4DC\uB97C \uC77D\uB294 \uC2DC\uAC04\uC774 \uC4F0\uB294 \uC2DC\uAC04\uC744 \uC555\uB3C4\uD569\uB2C8\uB2E4. \uC88B\uC740 \uCF54\uB4DC\uB97C \uC77D\uC5B4\uBD10\uC57C \uC88B\uC740 \uCF54\uB4DC\uB97C \uC4F8 \uC218 \uC788\uAE30\uB3C4 \uD558\uACE0\uC694.</p><p>S \uB2D8\uC740 \uD29C\uD1A0\uB9AC\uC5BC\uC744 \uC77D\uC5B4 \uB098\uAC00\uBA74\uC11C \uD2C8\uD2C8\uC774 \uD574\uB2F9 \uC5B8\uC5B4\uC758 \uD45C\uC900 \uB77C\uC774\uBE0C\uB7EC\uB9AC\uB97C \uCC3E\uC544 \uC77D\uC5C8\uC2B5\uB2C8\uB2E4.</p><p>Java\uB85C \uC791\uC131\uB41C \uD504\uB85C\uADF8\uB7A8\uC774\uB0D0 C\uB85C \uC791\uC131\uB41C \uD504\uB85C\uADF8\uB7A8\uC774\uB0D0\uB97C \uAC00\uB974\uB294 \uC9C4\uC9DC \uAE30\uC900\uC740 \uC5B4\uB5A4 \uC5B8\uC5B4\uC758 \uD0A4\uC6CC\uB4DC\uB97C \uC37C\uB290\uB0D0\uAC00 \uC544\uB2C8\uB77C \uC5B4\uB5A4 \uC2A4\uD0C0\uC77C\uC744 \uB530\uB974\uACE0 \uC5B4\uB5A4 \uC219\uC5B4\uB97C \uC0AC\uC6A9\uD588\uB294\uAC00\uC785\uB2C8\uB2E4.</p><h4 id="\u1100\u1169\u11BC\u1107\u116E-\u110C\u116E\u11BC-\u1103\u1161\u1105\u1173\u11AB-\u1109\u1161\u1105\u1161\u11B7\u110B\u1174-\u110F\u1169\u1103\u1173\u110B\u1166-\u1102\u1162\u1100\u1161-\u1111\u1175\u11AF\u110B\u116D\u1112\u1161\u11AB-\u1100\u1175\u1102\u1173\u11BC\u110B\u1173\u11AF-\u110E\u116E\u1100\u1161\u1112\u1161\u11AB\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1100\u1169\u11BC\u1107\u116E-\u110C\u116E\u11BC-\u1103\u1161\u1105\u1173\u11AB-\u1109\u1161\u1105\u1161\u11B7\u110B\u1174-\u110F\u1169\u1103\u1173\u110B\u1166-\u1102\u1162\u1100\u1161-\u1111\u1175\u11AF\u110B\u116D\u1112\u1161\u11AB-\u1100\u1175\u1102\u1173\u11BC\u110B\u1173\u11AF-\u110E\u116E\u1100\u1161\u1112\u1161\u11AB\u1103\u1161" aria-hidden="true">#</a> \uACF5\uBD80 \uC911 \uB2E4\uB978 \uC0AC\uB78C\uC758 \uCF54\uB4DC\uC5D0 \uB0B4\uAC00 \uD544\uC694\uD55C \uAE30\uB2A5\uC744 \uCD94\uAC00\uD55C\uB2E4</h4><h4 id="\u110C\u1165\u11AB\u1106\u116E\u11AB\u1109\u1165\u11BC\u110B\u1173\u11AF-\u1112\u116D\u1100\u116A\u110C\u1165\u11A8\u110B\u1173\u1105\u1169-\u1108\u1169\u11B8\u110B\u1161\u1102\u1162\u1102\u1173\u11AB-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u1100\u1161-\u1103\u116C\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u110C\u1165\u11AB\u1106\u116E\u11AB\u1109\u1165\u11BC\u110B\u1173\u11AF-\u1112\u116D\u1100\u116A\u110C\u1165\u11A8\u110B\u1173\u1105\u1169-\u1108\u1169\u11B8\u110B\u1161\u1102\u1162\u1102\u1173\u11AB-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u1100\u1161-\u1103\u116C\u1100\u1175" aria-hidden="true">#</a> \uC804\uBB38\uC131\uC744 \uD6A8\uACFC\uC801\uC73C\uB85C \uBF51\uC544\uB0B4\uB294 \uC804\uBB38\uAC00\uAC00 \uB418\uAE30</h4><p>\uD55C \uAC00\uC9C0 \uBE44\uACB0\uC740 \uC804\uBB38\uAC00\uAC00 \uAD6C\uCCB4\uC801\uC778 \uC0AC\uAC74\uC5D0 \uB300\uD574 \uB9D0\uD558\uB3C4\uB85D \uC720\uB3C4\uD558\uB294 \uAC81\uB2C8\uB2E4.</p><p>S \uB2D8\uC758 \uACBD\uC6B0\uC5D0\uB294, \uAC00\uC7A5 \uCD5C\uADFC\uC5D0 \uC775\uD78C \uC5B8\uC5B4\uAC00 Go\uB77C\uACE0 \uD558\uB354\uAD70\uC694. \uADF8 \uC5B8\uC5B4\uB97C \uC775\uD78C \uACFC\uC815\uC744 \uC2DC\uAC04\uB300\uBCC4\uB85C \uC9DA\uC5B4\uAC00\uBA70 \uC5B4\uB5A4 \uD589\uB3D9\uC744 \uD588\uB294\uC9C0, \uADF8\uB9AC\uACE0 \uC554\uBB35\uC801\uC778 \uC758\uC0AC\uACB0\uC815\uACFC \uC0C1\uD669\uD310\uB2E8\uC774 \uBB34\uC5C7\uC774\uC5C8\uB294\uC9C0\uB97C \uCD94\uCD9C\uD588\uC2B5\uB2C8\uB2E4.</p><h3 id="\u1109\u1175\u11AF\u1109\u116E\u1102\u1173\u11AB-\u110B\u1168\u1107\u1161\u11BC\u1112\u1161\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1175-\u110B\u1161\u1102\u1175\u1105\u1161-\u1100\u116A\u11AB\u1105\u1175\u1112\u1161\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1175\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1109\u1175\u11AF\u1109\u116E\u1102\u1173\u11AB-\u110B\u1168\u1107\u1161\u11BC\u1112\u1161\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1175-\u110B\u1161\u1102\u1175\u1105\u1161-\u1100\u116A\u11AB\u1105\u1175\u1112\u1161\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1175\u1103\u1161" aria-hidden="true">#</a> \uC2E4\uC218\uB294 \uC608\uBC29\uD558\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C \uAD00\uB9AC\uD558\uB294 \uAC83\uC774\uB2E4</h3><h4 id="\u1106\u1175\u110B\u1167\u11AB\u110B\u1166-\u1109\u1175\u11AF\u1109\u116E\u1105\u1173\u11AF-\u1106\u1161\u11A8\u110B\u1161\u110B\u1163-\u1112\u1161\u11AB\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1106\u1175\u110B\u1167\u11AB\u110B\u1166-\u1109\u1175\u11AF\u1109\u116E\u1105\u1173\u11AF-\u1106\u1161\u11A8\u110B\u1161\u110B\u1163-\u1112\u1161\u11AB\u1103\u1161" aria-hidden="true">#</a> \uBBF8\uC5F0\uC5D0 \uC2E4\uC218\uB97C \uB9C9\uC544\uC57C \uD55C\uB2E4?</h4><p>\uBBF8\uAD6D \uC0B0\uB9BC\uCCAD\uC758 \uC0B0\uBD88 \uC815\uCC45\uC774 \uC218\uC2ED\uB144 \uC804\uC5D0 \uBC14\uB010 \uAC83\uC744 \uC544\uC2ED\uB2C8\uAE4C? \uC608\uC804\uC5D0\uB294 \uC0B0\uBD88 \uC608\uBC29\uC744 \uAC15\uC870\uD588\uC2B5\uB2C8\uB2E4.</p><p>\uC774\uC81C\uB294 \uBD88 \uC608\uBC29\uC5D0\uC11C \uBD88 \uAD00\uB9AC \uCABD\uC73C\uB85C \uCD08\uC810\uC774 \uBC14\uB00C\uC5C8\uC2B5\uB2C8\uB2E4.</p><p>\uD765\uBBF8\uB85C\uC6B4 \uBD80\uBD84\uC740 \uAC00\uC7A5 \uC0AC\uB9DD\uB960\uC774 \uB192\uC740 \uBCD1\uC6D0\uACFC \uAC00\uC7A5 \uB0AE\uC740 \uBCD1\uC6D0 \uC9D1\uB2E8 \uC0AC\uC774\uC5D0 \uC218\uC220 \uD6C4 \uD569\uBCD1\uC99D \uBC1C\uC0DD \uD655\uB960\uC774 \uD1B5\uACC4\uC801\uC73C\uB85C \uCC28\uC774\uAC00 \uC788\uC5C8\uB2E4\uB294 \uC810\uC785\uB2C8\uB2E4. \uADF8\uB7FC \uBB34\uC5C7\uC774 \uC0AC\uB9DD\uB960\uC758 \uCC28\uC774\uB97C \uB9CC\uB4E4\uC5C8\uC744\uAE4C\uC694? \uD569\uBCD1\uC99D\uC744 \uBC1C\uACAC\uD558\uACE0 \uC801\uC808\uD55C \uC870\uCE58\uB97C \uCDE8\uD558\uB294 \uBD80\uBD84\uC5D0\uC11C \uCC28\uC774\uAC00 \uB0AC\uC2B5\uB2C8\uB2E4. ... \uC0AC\uB9DD\uB960\uC774 \uB0AE\uC740 \uBCD1\uC6D0\uC740 \uC2EC\uAC01\uD55C \uD569\uBCD1\uC99D\uC774 \uBC8C\uC5B4\uC9C0\uB294 \uAC83\uC744 \uC798 \uC54C\uC544\uCC58\uACE0, \uB610 \uD569\uBCD1\uC99D\uC774 \uC0DD\uAE34 \uD6C4 \uC801\uC808\uD55C \uC870\uCE58\uB97C \uD588\uB358 \uAC83\uC774\uC8E0.</p><h4 id="\u1103\u116E-\u1100\u1161\u110C\u1175\u110B\u1174-\u1109\u1175\u11AF\u1109\u116E-\u1106\u116E\u11AB\u1112\u116A" tabindex="-1"><a class="header-anchor" href="#\u1103\u116E-\u1100\u1161\u110C\u1175\u110B\u1174-\u1109\u1175\u11AF\u1109\u116E-\u1106\u116E\u11AB\u1112\u116A" aria-hidden="true">#</a> \uB450 \uAC00\uC9C0\uC758 \uC2E4\uC218 \uBB38\uD654</h4><p>\uC2E4\uC218 \uC608\uBC29 \uBB38\uD654\uC5D0\uC11C\uB294 \uC2E4\uC218\uB97C \uD55C \uC0AC\uB78C\uC744 \uBE44\uB09C\uD558\uACE0, \uCC98\uBC8C\uD558\uACE0, \uB530\uB77C\uC11C \uC2E4\uC218\uB97C \uAC10\uCD94\uACE0 \uADF8\uC5D0 \uB300\uD574 \uB17C\uC758\uD558\uAE30 \uAEBC\uB9AC\uBA70 \uBB38\uC81C\uAC00 \uC0DD\uACBC\uC744 \uB54C \uD611\uB825\uB3C4 \uB35C \uD558\uAC8C \uB429\uB2C8\uB2E4. \uBC18\uB300\uB85C \uC2E4\uC218 \uAD00\uB9AC \uBB38\uD654\uC5D0\uC11C\uB294 \uC2E4\uC218\uAC00 \uB098\uC05C \uACB0\uACFC\uB97C \uB0B4\uAE30 \uC804\uC5D0 \uBE68\uB9AC \uD68C\uBCF5\uD558\uB3C4\uB85D \uB3D5\uACE0, \uC2E4\uC218\uB97C \uACF5\uAC1C\uD558\uACE0, \uC2E4\uC218\uC5D0 \uB300\uD574 \uC11C\uB85C \uC774\uC57C\uAE30\uD558\uACE0 \uAC70\uAE30\uC5D0\uC11C \uBC30\uC6B0\uB294 \uBD84\uC704\uAE30\uAC00 \uC0DD\uAE41\uB2C8\uB2E4.</p><p>\uC2E4\uC218 \uC5F0\uAD6C\uC758 \uC5ED\uC0AC\uB97C \uBCF4\uBA74, \uCD08\uAE30\uC5D0\uB294 \uAE30\uC220\uC801\uC778 \uBD80\uBD84\uB9CC \uBCF4\uB2E4\uAC00 \uADF8 \uB2E4\uC74C\uC5D0\uB294 \uC778\uAC04\uC801\uC778 \uBD80\uBD84\uC744 \uBCF4\uB2E4\uAC00, \uC774\uC81C\uB294 \uBB38\uD654\uC801\uC778 \uBD80\uBD84\uC744 \uC774\uC57C\uAE30\uD569\uB2C8\uB2E4.</p><p>\uC2E4\uC218\uAC00 \uC5C6\uC73C\uBA74 \uD559\uC2B5\uD558\uC9C0 \uBABB\uD569\uB2C8\uB2E4. \uC774\uB294 \uD559\uC2B5\uC774\uB860\uC758 \uAE30\uBCF8\uC785\uB2C8\uB2E4.</p><p>\uB2E4\uC591\uD55C \uC2E4\uC218\uB97C \uACBD\uD5D8\uD558\uB294 \uAC78 \uACA9\uB824\uD558\uACE0, \uC2E4\uC218 \uC0AC\uB840\uB97C \uBC30\uC6B0\uACE0, \uC2E4\uC218 \uC2DC\uC5D0 \uC5B4\uB5BB\uAC8C \uB300\uCC98\uD558\uB294\uAC00\uB97C \uAC00\uB974\uCE58\uB294 \uAD50\uC721\uC774 \uB354 \uD6A8\uACFC\uC801\uC774\uB77C\uB294 \uC5F0\uAD6C \uACB0\uACFC\uAC00 \uB9CE\uC2B5\uB2C8\uB2E4.</p><h3 id="\u1104\u1171\u110B\u1165\u1102\u1161\u11AB-\u1109\u1165\u11AB\u1109\u1162\u11BC\u110B\u1166-\u1103\u1162\u1112\u1161\u11AB-\u1106\u1175\u1109\u1175\u11AB" tabindex="-1"><a class="header-anchor" href="#\u1104\u1171\u110B\u1165\u1102\u1161\u11AB-\u1109\u1165\u11AB\u1109\u1162\u11BC\u110B\u1166-\u1103\u1162\u1112\u1161\u11AB-\u1106\u1175\u1109\u1175\u11AB" aria-hidden="true">#</a> \uB6F0\uC5B4\uB09C \uC120\uC0DD\uC5D0 \uB300\uD55C \uBBF8\uC2E0</h3><p>\uD765\uBBF8\uB86D\uAC8C\uB3C4 \uB9CE\uC740 \uC870\uC9C1\uC5D0\uC11C \uAD50\uC721\uC740 \uD22C\uC785\uC73C\uB85C \uC131\uACFC\uB97C \uCE21\uC815\uD558\uB294 \uB300\uD45C\uC801 \uBD84\uC57C\uC785\uB2C8\uB2E4.</p><p>\uAE30\uC5C5\uC5D0\uC11C\uC758 \uAD50\uC721, \uD6C8\uB828 \uD6A8\uACFC\uC5D0 \uB300\uD55C \uBA54\uD0C0\uBD84\uC11D \uC5F0\uAD6C\uC5D0 \uB530\uB974\uBA74 \uB300\uBD80\uBD84\uC758 \uD6C8\uB828\uC740 6\uAC1C\uC6D4 \uC815\uB3C4\uB9CC \uC9C0\uB098\uB3C4 \uD6A8\uACFC\uAC00 \uAC70\uC758 \uC0AC\uB77C\uC9D1\uB2C8\uB2E4.</p><p>\uC874 \uD574\uD2F0\uC758 \uC5F0\uAD6C\uC5D0 \uB530\uB974\uBA74 \uAD50\uC0AC\uAC00 \uAC00\uC9C4 \uC8FC\uC81C\uC5D0 \uB300\uD55C \uC9C0\uC2DD\uC218\uC900\uC740 \uD6A8\uACFC \uD06C\uAE30\uAC00 0.09\uC5D0 \uC9C0\uB098\uC9C0 \uC54A\uC73C\uBA70 ... \uAD50\uC0AC\uAC00 \uC9C0\uC2DD\uC774 \uC5BC\uB9C8\uB098 \uB9CE\uC740\uC9C0\uB294 \uD070 \uC601\uD5A5\uC744 \uBBF8\uCE58\uB294 \uC694\uC18C\uAC00 \uC544\uB2C8\uB77C\uB294 \uB9D0\uC774\uC9C0\uC694.</p><p>\uC65C \uADF8\uB7F4\uAE4C\uC694? ... \uC5EC\uAE30\uC5D0\uC11C\uB294 \uD2B9\uD788 &#39;\uC544\uB294 \uAC83\uC744 \uC628\uC804\uD788 \uAC00\uB974\uCE60 \uC218 \uC788\uB294\uAC00&#39;\uD558\uB294 \uBA74\uC5D0 \uCD08\uC811\uC744 \uB9DE\uCDB0\uBCF4\uC8E0.</p><h4 id="\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u1100\u1161-\u1100\u1161\u1105\u1173\u110E\u1167\u110C\u116E\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1173\u11AB-\u110C\u1165\u11AB\u1107\u116E\u1100\u1161-\u110B\u1161\u1102\u1175\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u1100\u1161-\u1100\u1161\u1105\u1173\u110E\u1167\u110C\u116E\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1173\u11AB-\u110C\u1165\u11AB\u1107\u116E\u1100\u1161-\u110B\u1161\u1102\u1175\u1103\u1161" aria-hidden="true">#</a> \uC804\uBB38\uAC00\uAC00 \uAC00\uB974\uCCD0\uC8FC\uB294 \uAC83\uC740 \uC804\uBD80\uAC00 \uC544\uB2C8\uB2E4</h4><p>\uC758\uB8CC\uACC4\uC758 \uC5F0\uAD6C\uB97C \uBCF4\uBA74, \uC804\uBB38\uAC00\uAC00 \uD2B9\uC815 \uC218\uC220\uBC95\uC744 \uD559\uC0DD\uC5D0\uAC8C \uAC00\uB974\uCE60 \uB54C, ... 70%\uB294 \uAC00\uB974\uCE58\uC9C0 \uC54A\uB294\uB2E4\uB294 \uBD84\uC11D\uC774 \uAC70\uB4ED\uD574 \uB098\uC654\uC2B5\uB2C8\uB2E4. \uAC00\uB974\uCE58\uB294 \uB2A5\uB825\uC744 \uC778\uC815\uBC1B\uACE0 \uD55C \uBC88 \uC774\uC0C1\uC758 &#39;\uD0C1\uC6D4\uD55C \uAD50\uC0AC\uC0C1&#39;\uC744 \uBC1B\uC740 \uC0AC\uB78C\uC784\uC5D0\uB3C4 \uADF8\uB7AC\uACE0, .. \uADF8 \uAE30\uC220\uC744 \uC131\uACF5\uC801\uC73C\uB85C \uD574\uB0B4\uAE30 \uC704\uD574 \uD544\uC694\uD55C \uAC83\uC758 30%\uB9CC \uAC00\uB974\uCCD0 \uB193\uACE0 \uC790\uC2E0\uC740 \uB2E4 \uAC00\uB974\uCCE4\uB2E4\uACE0 \uC0DD\uAC01\uD558\uB294 \uAC81\uB2C8\uB2E4.</p><p>\uC774\uB7F0 \uD604\uC0C1\uC774 \uBC8C\uC5B4\uC9C0\uB294 \uC774\uC720\uC5D0\uB294 ... \uB300\uD45C\uC801\uC778 \uAC83\uC774 \uC790\uB3D9\uD654\uC785\uB2C8\uB2E4. \uC804\uBB38\uAC00\uAC00 \uB418\uBA74 \uC790\uC2E0\uC774 \uD558\uB294 \uC77C\uC774 \uBC18\uBCF5\uC801\uC73C\uB85C \uBAB8\uC5D0 \uC775\uACE0 \uC790\uB3D9\uD654\uAC00 \uB418\uC5B4\uC11C \uACB0\uAD6D \uC554\uBB35\uC801\uC774 \uB418\uC5B4 \uBC84\uB9BD\uB2C8\uB2E4.</p><h4 id="\u110B\u1175\u11AB\u110C\u1175\u110C\u1165\u11A8-\u110C\u1161\u11A8\u110B\u1165\u11B8-\u1107\u116E\u11AB\u1109\u1165\u11A8\u110B\u1173\u1105\u1169-\u1100\u1173\u11A8\u1107\u1169\u11A8\u1112\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11AB\u110C\u1175\u110C\u1165\u11A8-\u110C\u1161\u11A8\u110B\u1165\u11B8-\u1107\u116E\u11AB\u1109\u1165\u11A8\u110B\u1173\u1105\u1169-\u1100\u1173\u11A8\u1107\u1169\u11A8\u1112\u1161\u1100\u1175" aria-hidden="true">#</a> \uC778\uC9C0\uC801 \uC791\uC5C5 \uBD84\uC11D\uC73C\uB85C \uADF9\uBCF5\uD558\uAE30</h4><p>\uC774\uAC78 \uADF9\uBCF5\uD558\uB294 \uBC29\uBC95\uC774 \uC788\uC744\uAE4C\uC694? \uB124. \uC788\uC2B5\uB2C8\uB2E4. ... \uD55C \uAC00\uC9C0 \uD78C\uD2B8\uB97C \uB4DC\uB9AC\uC790\uBA74, \uC55E\uC5D0\uC11C &lt;\uD504\uB85C\uADF8\uB798\uBC0D \uC5B8\uC5B4 \uBC30\uC6B0\uAE30\uC758 \uB2EC\uC778&gt;\uC758 \uC778\uC9C0\uC801 \uC791\uC5C5 \uBD84\uC11D \uAC19\uC740 \uBC29\uBC95\uC744 \uC120\uC0DD\uACFC \uD559\uC0DD\uC774 \uC4F0\uB294 \uAC81\uB2C8\uB2E4. ... \uBA54\uD0C0\uBD84\uC11D\uC5D0 \uB530\uB974\uBA74 \uC120\uC0DD\uC774 \uC778\uC9C0\uC801 \uC791\uC5C5 \uBD84\uC11D\uC5D0 \uB2A5\uC219\uD55C\uAC00 \uD558\uB294 \uAC83\uC774 \uD559\uC0DD\uB4E4\uC758 \uD559\uC5C5\uC131\uCDE8\uB3C4\uC5D0 \uBBF8\uCE58\uB294 \uC5EC\uD5A5\uC758 \uD6A8\uACFC \uD06C\uAE30\uAC00 \uC790\uADF8\uB9CC\uCE58 1.29\uB098 \uB429\uB2C8\uB2E4. \uC774\uB7F0 \uBD84\uC11D \uB2A5\uB825\uC774 \uB6F0\uC5B4\uB09C \uC120\uC0DD\uC774 \uC798 \uAC00\uB974\uCE58\uB294 \uC0AC\uB78C\uC774\uB77C\uB294 \uC774\uC57C\uAE30\uC785\uB2C8\uB2E4.</p><p>\uB610 \uC120\uC0DD\uC758 \uBA54\uD0C0\uC778\uC9C0\uB97C \uB3D5\uAE30 \uC704\uD574 \uC790\uAE30\uAC00 \uC5B4\uB5BB\uAC8C \uC0DD\uAC01\uD558\uBA74\uC11C \uC774 \uBB38\uC81C\uB97C \uD480\uC5C8\uB294\uC9C0 \uADF8 \uC778\uC9C0\uC801 \uACFC\uC815\uC744 \uC120\uC0DD\uC5D0\uAC8C \uC54C\uB824\uC8FC\uB294 \uAC83\uB3C4 \uB9E4\uC6B0 \uD6A8\uACFC\uC801\uC785\uB2C8\uB2E4.</p><h3 id="\u1102\u1161\u1112\u1169\u11AF\u1105\u1169-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u110B\u1166-\u1103\u1162\u1112\u1161\u11AB-\u1106\u1175\u1109\u1175\u11AB" tabindex="-1"><a class="header-anchor" href="#\u1102\u1161\u1112\u1169\u11AF\u1105\u1169-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u110B\u1166-\u1103\u1162\u1112\u1161\u11AB-\u1106\u1175\u1109\u1175\u11AB" aria-hidden="true">#</a> \uB098\uD640\uB85C \uC804\uBB38\uAC00\uC5D0 \uB300\uD55C \uBBF8\uC2E0</h3><p>\uBCF4\uD1B5\uC740 \uC5B4\uB5A4 \uC0AC\uB78C\uC774 \uC804\uBB38\uAC00\uB77C\uACE0 \uD558\uBA74 \uADF8 \uC0AC\uB78C\uC758 \uB1CC \uC548\uC5D0\uC11C \uBB34\uC2A8 \uC77C\uC774 \uBC8C\uC5B4\uC9C8\uAE4C\uC5D0\uB9CC \uC8FC\uBAA9\uD558\uB294 \uBA74\uC774 \uC788\uC2B5\uB2C8\uB2E4. &#39;\uACE0\uB3C5\uD55C \uCC9C\uC7AC&#39;\uAC19\uC740 ... \uC774\uBBF8\uC9C0\uB85C \uB5A0\uC62C\uB9AC\uAE30\uB3C4 \uD558\uC8E0. \uADF8\uB7F0\uB370 \uACFC\uC5F0 \uD604\uC2E4\uC5D0\uC11C\uC758 \uC804\uBB38\uAC00\uAC00 \uC815\uB9D0 \uADF8\uB7F0 \uC0AC\uB78C\uC77C\uAE4C\uC694?</p><p><strong>\uBB58 \uD558\uB4E0\uC9C0 \uB098 \uD63C\uC790\uAC00 \uC544\uB2C8\uB77C \uD56D\uC0C1 \uB204\uAD70\uAC00\uAC00 \uB4F1\uC7A5\uD558\uACE0, \uC77C\uC758 \uC131\uD328\uC5D0 \uB2E4\uB978 \uC0AC\uB78C\uC774 \uAD00\uB828\uB418\uC5B4 \uC788\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4. \uC815\uB9AC\uD558\uBA74 \uB2E4\uC74C\uACFC \uAC19\uC2B5\uB2C8\uB2E4.</strong></p><p><strong>1) \uC544\uBB34\uB9AC \uAE30\uC220\uC801\uC778 \uC2E4\uCC9C\uBC95\uC774\uB77C\uACE0 \uD574\uB3C4 2) \uADF8 \uAE30\uC220\uC740 \uC0AC\uD68C\uC801 \uB9E5\uB77D \uC18D\uC5D0\uC11C \uC2E4\uCC9C\uB418\uC5B4\uC57C \uD558\uBA70 3) \uADF8 \uAE30\uC220\uC758 \uC131\uACF5\uC744 \uC704\uD574\uC11C\uB294 \uC0AC\uD68C\uC801 \uC790\uBCF8\uACFC \uC0AC\uD68C\uC801 \uAE30\uC220\uC774 \uD568\uAED8 \uD544\uC694\uD558\uB2E4.</strong></p><h4 id="\u1109\u1161\u1112\u116C\u110C\u1165\u11A8-\u110C\u1161\u1107\u1169\u11AB\u1100\u116A-\u1100\u1175\u1109\u116E\u11AF" tabindex="-1"><a class="header-anchor" href="#\u1109\u1161\u1112\u116C\u110C\u1165\u11A8-\u110C\u1161\u1107\u1169\u11AB\u1100\u116A-\u1100\u1175\u1109\u116E\u11AF" aria-hidden="true">#</a> \uC0AC\uD68C\uC801 \uC790\uBCF8\uACFC \uAE30\uC220</h4><p>\uC2E0\uB8B0\uAC00 \uAE68\uC5B4\uC838 \uC788\uB294 \uC0C1\uD0DC\uC5D0\uC11C\uB294 \uC5B4\uB5A4 \uD589\uB3D9\uC744 \uD574\uB3C4 \uC545\uC758\uC801\uC73C\uB85C \uBCF4\uC778\uB2E4\uB294 \uAC83\uC785\uB2C8\uB2E4.</p><p>\uC774 \uC2E0\uB8B0\uB97C \uC0AC\uD68C\uC801 \uC790\uBCF8\uC758 \uC77C\uC885\uC774\uB77C\uACE0 \uD569\uB2C8\uB2E4.</p><h4 id="\u1100\u1169\u1103\u1169\u11A8\u1112\u1161\u11AB-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u1105\u1161\u1102\u1173\u11AB-\u1106\u1175\u1109\u1175\u11AB" tabindex="-1"><a class="header-anchor" href="#\u1100\u1169\u1103\u1169\u11A8\u1112\u1161\u11AB-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u1105\u1161\u1102\u1173\u11AB-\u1106\u1175\u1109\u1175\u11AB" aria-hidden="true">#</a> \uACE0\uB3C5\uD55C \uC804\uBB38\uAC00\uB77C\uB294 \uBBF8\uC2E0</h4><p>\uC804\uBB38\uAC00\uAC00 \uD574\uB2F9 \uB3C4\uBA54\uC778 \uC9C0\uC2DD\uB9CC \uB6F0\uC5B4\uB09C \uC0AC\uB78C\uC774\uB77C\uB294 \uAC83\uC740 \uB300\uD45C\uC801\uC778 \uBBF8\uC2E0\uC785\uB2C8\uB2E4. <strong>\uC804\uBB38\uAC00\uB294 \uC0AC\uD68C\uC801 \uC790\uBCF8\uACFC \uC0AC\uD68C\uC801 \uAE30\uC220 \uB610\uD55C \uB6F0\uC5B4\uB0A9\uB2C8\uB2E4.</strong></p><p>\uC774\uC81C\uB294 \uD504\uB85C\uADF8\uB798\uBC0D\uC744 \uC798\uD55C\uB2E4\uB294 \uC815\uC758 \uC548\uC5D0 \uC758\uC0AC\uC18C\uD1B5 \uB2A5\uB825\uC744 \uADF8 \uC77C\uBD80\uB85C \uBCF4\uAC8C \uB41C \uAC81\uB2C8\uB2E4.</p><p>\uD76C\uB9DD\uC801\uC778 \uC18C\uC2DD\uC740 \uC774\uB7F0 \uC0AC\uD68C\uC801 \uAE30\uC220\uC744 \uD6C8\uB828\uC73C\uB85C \uAC1C\uC120\uD560 \uC218 \uC788\uB2E4\uB294 \uAC81\uB2C8\uB2E4.</p><p>\uAC04\uB2E8\uD55C \uBC29\uBC95\uC740 \uC8FC\uBCC0 \uC0AC\uB78C\uB4E4\uACFC \uC8FC\uACE0\uBC1B\uB294 \uB9C8\uC774\uD06C\uB85C \uC778\uD130\uB799\uC158\uC5D0 \uC2E0\uACBD\uC744 \uC4F0\uB294 \uAC81\uB2C8\uB2E4. \uADF8\uAC78 \uAE30\uB85D\uD558\uACE0, \uBCF5\uAE30\uD558\uACE0, \uB2E4\uB974\uAC8C \uC778\uD130\uB799\uC158\uD55C\uB2E4\uACE0 \uD558\uBA74 \uC5B4\uB5BB\uAC8C \uD588\uC73C\uBA74 \uC88B\uC558\uC744\uAE4C\uB97C \uC0DD\uAC01\uD574\uBCF4\uB294 \uAC83\uB9CC\uC73C\uB85C\uB3C4 \uD6C8\uB828\uC774 \uB420 \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p><p>\uC800\uB294 ... TDD\uB97C \uC0AC\uB78C\uB4E4\uC5D0\uAC8C \uAD50\uC721\uD558\uACE0 \uCEE8\uC124\uD305\uD574\uC8FC\uC5C8\uC2B5\uB2C8\uB2E4. \uC81C \uACBD\uD5D8\uC5D0 \uD55C\uD574\uC11C\uB294 TDD \uB3C4\uC785\uC5D0 \uC2E4\uD328\uD558\uB294 \uACBD\uC6B0, ... \uD544\uC694\uD55C \uC0AC\uD68C\uC801 \uC790\uBCF8\uACFC \uC0AC\uD68C\uC801 \uAE30\uC220\uC774 \uC5C6\uC5B4\uC11C\uAC00 \uD6E8\uC52C \uB354 \uB9CE\uC558\uC2B5\uB2C8\uB2E4.</p><p>\uC5B4\uB5A4 \uAE30\uC220\uC801 \uC9C0\uC2DD\uC744 \uC804\uB2EC\uD55C\uB2E4\uACE0 \uD574\uB3C4 \uADF8\uAC83\uC744 \uC0AC\uD68C\uC801 \uB9E5\uB77D \uC18D\uC5D0\uC11C \uAC00\uB974\uCE58\uACE0 \uACBD\uD5D8\uD558\uAC8C \uD558\uB824\uACE0 \uB178\uB825\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4.</p><p>\uC81C\uAC00 \uC911\uC694\uD558\uAC8C \uB2E4\uB8E8\uB294 \uC0AC\uD68C\uC801 \uAE30\uC220\uC740 \uB3C4\uC6C0\uBC1B\uAE30, \uD53C\uB4DC\uBC31 \uC8FC\uACE0\uBC1B\uAE30, \uC601\uD5A5\uB825 \uBBF8\uCE58\uAE30, \uAC00\uB974\uCE58\uACE0 \uBC30\uC6B0\uAE30, \uC704\uC784\uD558\uAE30 \uB4F1\uC774 \uC788\uC2B5\uB2C8\uB2E4.</p><h2 id="\u1112\u1161\u11B7\u1101\u1166" tabindex="-1"><a class="header-anchor" href="#\u1112\u1161\u11B7\u1101\u1166" aria-hidden="true">#</a> \uD568\uAED8</h2><p>\uC0AC\uB78C\uB4E4\uC740 \uD611\uB825\uC774 \uC911\uC694\uD558\uB2E4\uACE0 \uD569\uB2C8\uB2E4. \uADF8\uB798\uC11C \uD504\uB85C\uC81D\uD2B8\uB97C \uD560 \uB54C \uD611\uB825\uC801\uC73C\uB85C \uD558\uC790\uACE0 \uD569\uB2C8\uB2E4. \uADF8\uB7EC\uB098 \uC2E4\uC81C \uBAA8\uC2B5\uC744 \uB4E4\uC5EC\uB2E4\uBCF4\uBA74 \uCD08\uBC18\uC5D0 \uC77C\uC744 \uC138\uBC00\uD558\uAC8C \uB098\uB204\uACE0 \uC120\uC744 \uAE0B\uC2B5\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uC548\uB155\uC774\uC8E0.</p><p>\uC6B0\uB9AC\uB294 \uD611\uB825\uC744 \uC81C\uB300\uB85C \uBC30\uC6CC\uBCF8 \uC801\uC774 \uAC70\uC758 \uC5C5\uC2DC \uB54C\uBB38\uC785\uB2C8\uB2E4.</p><p>\uADF8\uB798\uC11C \uC9C0\uAE08\uBD80\uD130\uB77C\uB3C4 \uD611\uB825 \uBC29\uBC95\uC744 \uBC30\uC6B0\uACE0 \uC218\uB828\uD574\uC57C \uD569\uB2C8\uB2E4.</p><h3 id="\u1109\u1169\u1111\u1173\u1110\u1173\u110B\u1170\u110B\u1165-\u1100\u116A\u11AB\u1105\u1175\u110C\u1161\u110B\u1174-\u1100\u1162\u1109\u1165\u11AB-\u110B\u116E\u1109\u1165\u11AB\u1109\u116E\u11AB\u110B\u1171" tabindex="-1"><a class="header-anchor" href="#\u1109\u1169\u1111\u1173\u1110\u1173\u110B\u1170\u110B\u1165-\u1100\u116A\u11AB\u1105\u1175\u110C\u1161\u110B\u1174-\u1100\u1162\u1109\u1165\u11AB-\u110B\u116E\u1109\u1165\u11AB\u1109\u116E\u11AB\u110B\u1171" aria-hidden="true">#</a> \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAD00\uB9AC\uC790\uC758 \uAC1C\uC120 \uC6B0\uC120\uC21C\uC704</h3><p>\uC870\uC5D8 \uD14C\uC2A4\uD2B8\uB77C\uB294 \uAC83\uC774 \uC788\uC2B5\uB2C8\uB2E4.</p><p>\uADF8\uB7EC\uB098 \uC5EC\uAE30\uC5D0 \uAC00\uC7A5 \uD070 \uC704\uD5D8\uC774 \uC874\uC7AC\uD569\uB2C8\uB2E4. \uC120\uC758\uC758 \uAD00\uB9AC\uC790\uB098 \uACBD\uC601\uC9C4\uC774 \uAC01 \uC9C8\uBB38\uC758 \uB9E5\uB77D\uC744 \uC774\uD574\uD558\uC9C0 \uBABB\uD55C \uCC44 \uB2E8\uC21C\uD788 12\uAC00\uC9C0 \uC9C8\uBB38\uC5D0 \uC608\uB77C\uACE0 \uB2F5\uD558\uB294 \uAC83\uC744 \uBAA9\uD45C\uB85C \uB178\uB825\uD558\uB294 \uACBD\uC6B0\uB97C \uB9D0\uD558\uB294 \uAC81\uB2C8\uB2E4.</p><h4 id="\u1106\u1169\u1103\u1173\u11AB-\u1112\u1161\u11BC\u1106\u1169\u11A8\u110B\u1166-\u110B\u1168-\u1105\u1161\u1100\u1169-\u1103\u1161\u11B8\u1112\u1161\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1175-\u1106\u116E\u110C\u1169\u1100\u1165\u11AB-\u1103\u1165-\u1102\u1161\u11BA\u1103\u1161\u1100\u1169-\u1103\u1169\u11BC\u110B\u1174\u1112\u1161\u1100\u1175-\u110B\u1165\u1105\u1167\u11B8\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1106\u1169\u1103\u1173\u11AB-\u1112\u1161\u11BC\u1106\u1169\u11A8\u110B\u1166-\u110B\u1168-\u1105\u1161\u1100\u1169-\u1103\u1161\u11B8\u1112\u1161\u1102\u1173\u11AB-\u1100\u1165\u11BA\u110B\u1175-\u1106\u116E\u110C\u1169\u1100\u1165\u11AB-\u1103\u1165-\u1102\u1161\u11BA\u1103\u1161\u1100\u1169-\u1103\u1169\u11BC\u110B\u1174\u1112\u1161\u1100\u1175-\u110B\u1165\u1105\u1167\u11B8\u1103\u1161" aria-hidden="true">#</a> \uBAA8\uB4E0 \uD56D\uBAA9\uC5D0 &quot;\uC608&quot;\uB77C\uACE0 \uB2F5\uD558\uB294 \uAC83\uC774 \uBB34\uC870\uAC74 \uB354 \uB0AB\uB2E4\uACE0 \uB3D9\uC758\uD558\uAE30 \uC5B4\uB835\uB2E4</h4><p>\uC81C\uAC00 \uC544\uB294 \uB6F0\uC5B4\uB09C \uD300\uB4E4\uC740 \uD234\uC744 \uACE0\uB97C \uB54C \uB2E8\uC21C\uD788 \uBE44\uC2FC \uAC8C \uBB50\uB0D0\uB97C \uAE30\uC900\uC73C\uB85C \uACE0\uB974\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4. \uC774 \uD56D\uBAA9\uC744 \uBCF4\uACE0 &#39;\uBE44\uC2FC \uD234\uC744 \uC4F0\uBA74 \uC798\uD558\uACA0\uC9C0&#39;\uD558\uACE0 \uC0DD\uAC01\uD558\uB294 \uAC74 \uAE30\uC220\uC744 \uC774\uD574\uD558\uC9C0 \uBABB\uD558\uB294 \uACBD\uC601\uC790 \uB9C8\uC778\uB4DC\uC5D0 \uAC00\uAE5D\uC2B5\uB2C8\uB2E4.</p><h4 id="_12\u1100\u1161\u110C\u1175-\u110C\u1175\u11AF\u1106\u116E\u11AB\u110B\u1175-\u1100\u1162\u1107\u1161\u11AF\u1110\u1175\u11B7-\u1111\u1167\u11BC\u1100\u1161\u110B\u1166\u1109\u1165-\u110C\u1165\u11BC\u1106\u1161\u11AF-\u110C\u116E\u11BC\u110B\u116D\u1112\u1161\u11AB-\u110B\u116D\u1109\u1169\u110B\u1175\u11AB\u1100\u1161" tabindex="-1"><a class="header-anchor" href="#_12\u1100\u1161\u110C\u1175-\u110C\u1175\u11AF\u1106\u116E\u11AB\u110B\u1175-\u1100\u1162\u1107\u1161\u11AF\u1110\u1175\u11B7-\u1111\u1167\u11BC\u1100\u1161\u110B\u1166\u1109\u1165-\u110C\u1165\u11BC\u1106\u1161\u11AF-\u110C\u116E\u11BC\u110B\u116D\u1112\u1161\u11AB-\u110B\u116D\u1109\u1169\u110B\u1175\u11AB\u1100\u1161" aria-hidden="true">#</a> 12\uAC00\uC9C0 \uC9C8\uBB38\uC774 \uAC1C\uBC1C\uD300 \uD3C9\uAC00\uC5D0\uC11C \uC815\uB9D0 \uC911\uC694\uD55C \uC694\uC18C\uC778\uAC00?</h4><p>\uD488\uC9C8 \uC804\uBB38\uAC00 \uC81C\uB7F4\uB4DC \uC640\uC778\uBC84\uADF8\uAC00 \uD55C \uB9D0\uC744 \uC0B4\uD3B4\uBD05\uC2DC\uB2E4. \uC774\uBD84\uC740 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC1C\uBC1C\uC744 \uC798 \uAD00\uB9AC\uD558\uB824\uBA74 \uC138 \uAC00\uC9C0 \uADFC\uBCF8\uC801 \uB2A5\uB825\uC774 \uD544\uC694\uD558\uB2E4\uACE0 \uD588\uC2B5\uB2C8\uB2E4.</p><ol><li>\uBCF5\uC7A1\uD55C \uC0C1\uD669\uC744 \uC774\uD574\uD558\uB294 \uB2A5\uB825\uC73C\uB85C, \uD504\uB85C\uC81D\uD2B8\uB97C \uACC4\uD68D\uD55C \uB2E4\uC74C \uAD00\uCC30\uD558\uACE0 \uD589\uB3D9\uD558\uC5EC \uACC4\uD68D\uC5D0 \uB9DE\uAC8C \uD504\uB85C\uC81D\uD2B8\uAC00 \uC9C4\uD589\uB418\uAC8C \uD558\uAC70\uB098 \uACC4\uD68D\uC744 \uBC14\uAFC0 \uC218 \uC788\uC5B4\uC57C \uD55C\uB2E4.</li><li>\uAD00\uCC30\uD558\uB294 \uB2A5\uB825\uC73C\uB85C, \uBB34\uC5C7\uC774 \uBC8C\uC5B4\uC9C0\uACE0 \uC788\uB294\uC9C0\uB97C \uAD00\uCC30\uD558\uACE0, \uD6A8\uACFC\uC801\uC778 \uC801\uC751 \uD589\uB3D9\uC744 \uD558\uAE30 \uC704\uD574 \uC790\uC2E0\uC774 \uAD00\uCC30\uD55C \uAC83\uC774 \uC5B4\uB5A4 \uC758\uBBF8\uC778\uC9C0 \uC774\uD574\uD560 \uC218 \uC788\uC5B4\uC57C \uD55C\uB2E4.</li><li>\uD589\uB3D9\uD558\uB294 \uB2A5\uB825\uC73C\uB85C, \uC5B4\uB824\uC6B4 \uB300\uC778 \uC0C1\uD669\uC5D0\uC11C \uC6B0\uB9AC\uAC00 \uC2EC\uC9C0\uC5B4 \uD63C\uB780\uC2A4\uB7FD\uAC70\uB098 \uD654\uAC00 \uB098 \uAC70\uB098 \uC544\uB2C8\uBA74 \uBB34\uC11C\uC6CC\uC11C \uB3C4\uB9DD\uCCD0 \uC228\uC5B4\uBC84\uB9AC\uACE0 \uC2F6\uC744 \uB54C\uC5D0\uB3C4 \uC801\uC808\uD558\uAC8C \uD589\uB3D9\uD560 \uC218 \uC788\uC5B4\uC57C \uD55C\uB2E4.</li></ol><p>\uC774 \uC138 \uAC00\uC9C0 \uB2A5\uB825\uC744 \uD65C\uC6A9\uD574 \uC2E4\uC81C \uC870\uC9C1\uACFC \uAC1C\uC778(\uAD00\uB9AC\uC790 \uC790\uC2E0\uC744 \uD3EC\uD568-\uC640\uC778\uBC84\uADF8\uB294 \uC790\uC2E0\uC744 \uBC14\uAFB8\uC9C0 \uBABB\uD558\uB294 \uC0AC\uB78C\uC740 \uB2E4\uB978 \uC0AC\uB78C\uC744 \uBC14\uAFB8\uB294 \uC77C\uB3C4 \uD560 \uC218 \uC5C6\uB2E4\uACE0 \uD569\uB2C8\uB2E4)</p><p>QSM 4\uAD8C\uC5D0 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC1C\uBC1C \uBE44\uC6A9\uC5D0 \uB300\uD55C \uB0B4\uC6A9\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uB2E4\uC74C \uB124 \uAC00\uC9C0 \uC694\uC18C\uC758 \uBD84\uB958\uC5D0\uC11C \uAC00\uC7A5 \uC911\uC694\uD55C \uAC83\uBD80\uD130 \uB098\uC5F4\uD574 \uBCF4\uC138\uC694.</p><ul><li>\uB3C4\uAD6C : \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC1C\uBC1C\uC5D0 \uC0AC\uC6A9\uD558\uB294 \uBAA8\uB4E0 \uC885\uB958\uC758 \uB3C4\uAD6C. \uCEF4\uD4E8\uD130, \uBAA8\uB2C8\uD130, \uB514\uBC84\uAC70, IDE</li><li>\uC0AC\uB78C : \uC0AC\uB78C\uB4E4\uC758 \uB2A5\uB825\uACFC \uACBD\uD5D8</li><li>\uC2DC\uC2A4\uD15C : \uC81C\uD488 \uC790\uCCB4\uC758 \uBCF5\uC7A1\uB3C4, \uC694\uAD6C\uB418\uB294 \uC2E0\uB8B0\uC131, DB \uD06C\uAE30, \uD0C0\uAE43(VM \uB4F1)\uC758 \uBCC0\uD654 \uAC00\uB2A5\uC131, \uC2A4\uCF00\uC904 \uC81C\uC57D \uB4F1</li><li>\uAD00\uB9AC : \uC0AC\uB78C\uC744 \uBC30\uC815\uD558\uACE0 \uC791\uC5C5 \uBD84\uBC30\uB97C \uC870\uC815\uD558\uACE0 \uC704\uC784\uD558\uB294 \uAC83, \uC791\uC5C5 \uBAA8\uB2C8\uD130\uB9C1, \uB3D9\uAE30\uB97C \uACE0\uCDE8\uD558\uB294 \uAC83, \uC791\uC5C5 \uC870\uAC74/\uD658\uACBD\uC744 \uAC1C\uC120\uD558\uB294 \uAC83, \uC790\uC6D0\uC758 \uC900\uBE44, \uB9AC\uC2A4\uD06C\uB97C \uC77C\uCC0D \uD655\uC778\uD558\uACE0 \uC801\uC808\uD55C \uC870\uCE58\uB97C \uCDE8\uD558\uB294 \uAC83, \uC694\uAD6C\uC0AC\uD56D\uACFC \uC124\uACC4 \uC2A4\uD399\uC774 \uBE44\uC900(validate)\uB418\uAC8C \uB3D5\uB294 \uAC83 \uB4F1</li></ul><p>\uBE44\uC2B7\uD55C \uD06C\uAE30\uC758 \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB97C \uAC1C\uBC1C\uD55C\uB2E4\uACE0 \uD560 \uB54C, \uAC01 \uBD84\uB958\uBCC4\uB85C \uBE44\uC6A9 \uBA74\uC5D0\uC11C \uAC00\uC7A5 \uC801\uAC8C \uB4DC\uB294 \uD68C\uC0AC\uBD80\uD130 \uADF8\uB807\uC9C0 \uC54A\uC740 \uD68C\uC0AC\uAE4C\uC9C0 100\uB4F1\uAE4C\uC9C0 \uC21C\uC704\uB97C \uB9E4\uAE41\uB2C8\uB2E4. 85\uB4F1\uC774\uB358 \uD68C\uC0AC\uAC00 10\uB4F1\uD558\uB294 \uD68C\uC0AC\uB85C &#39;\uAC1C\uC120&#39;\uC744 \uD588\uB2E4\uBA74 \uAC1C\uBC1C \uBE44\uC6A9\uC774 \uC5BC\uB9C8\uB098 \uC904\uC5B4\uB4E4\uAE4C\uC694? \uAC1C\uC120\uD6A8\uACFC\uAC00 \uB192\uC740 \uAC83\uC740 \uBB34\uC5C7\uC77C\uAE4C\uC694?</p><p>...</p><p>\uAD00\uB9AC, \uC2DC\uC2A4\uD15C, \uC0AC\uB78C, \uB3C4\uAD6C \uC21C\uC11C\uC600\uC2B5\uB2C8\uB2E4. ... \uD558\uC9C0\uB9CC \uAC01 \uBD84\uB958\uBCC4\uB85C \uC2E4\uC81C\uB85C \uAC1C\uC120 \uC2DC\uB3C4\uAC00 \uC5BC\uB9C8\uB098 \uC788\uC5C8\uB294\uC9C0 \uD655\uC778\uD574 \uBCF4\uB2C8 \uAC00\uC7A5 \uB9CE\uC740 \uAC1C\uC120 \uB178\uB825\uC774 \uC788\uC5C8\uB358 \uBD84\uB958\uB97C \uBC14\uB85C &#39;\uB3C4\uAD6C&#39;\uC600\uC2B5\uB2C8\uB2E4</p><p>\uB2E4\uC2DC \uC870\uC5D8 \uD14C\uC2A4\uD2B8\uB85C \uB3CC\uC544\uAC11\uC2DC\uB2E4. \uC870\uC5D8 \uD14C\uC2A4\uD2B8\uB294 \uAC00\uC7A5 \uB9CC\uB9CC\uD558\uACE0 \uC26C\uC6B4 \uAC83\uBD80\uD130 \uC2DC\uC791\uD558\uB294 \uAD00\uB9AC\uC790\uC758 \uC131\uD5A5\uACFC \uCDA9\uB3CC\uD558\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4.</p><p>\uC800\uB294 \uAD00\uB9AC\uC790\uAC00 \uB208\uC5D0 \uC798 \uBCF4\uC774\uACE0 \uAC08\uC544\uCE58\uC6B0\uAE30 \uC26C\uC6B4 &#39;\uB3C4\uAD6C&#39;\uB4E4\uC5D0 \uC2E0\uACBD\uC744 \uC4F0\uB294 \uAC83\uC774 \uC704\uD5D8\uD558\uB2E4\uACE0 \uC0DD\uAC01\uD569\uB2C8\uB2E4.</p><h3 id="\u1112\u1167\u11B8\u1105\u1167\u11A8\u110B\u1173\u11AF-\u1110\u1169\u11BC\u1112\u1161\u11AB-\u110E\u116E\u1109\u1161\u11BC\u1112\u116A" tabindex="-1"><a class="header-anchor" href="#\u1112\u1167\u11B8\u1105\u1167\u11A8\u110B\u1173\u11AF-\u1110\u1169\u11BC\u1112\u1161\u11AB-\u110E\u116E\u1109\u1161\u11BC\u1112\u116A" aria-hidden="true">#</a> \uD611\uB825\uC744 \uD1B5\uD55C \uCD94\uC0C1\uD654</h3><h4 id="\u110F\u1165\u1106\u1172\u1102\u1175\u110F\u1166\u110B\u1175\u1109\u1167\u11AB\u1100\u116A-\u1112\u1167\u11B8\u1105\u1167\u11A8" tabindex="-1"><a class="header-anchor" href="#\u110F\u1165\u1106\u1172\u1102\u1175\u110F\u1166\u110B\u1175\u1109\u1167\u11AB\u1100\u116A-\u1112\u1167\u11B8\u1105\u1167\u11A8" aria-hidden="true">#</a> \uCEE4\uBBA4\uB2C8\uCF00\uC774\uC158\uACFC \uD611\uB825</h4><p>\uC77C\uBC18\uC801\uC73C\uB85C, \uC2E4\uB825\uC774 \uB6F0\uC5B4\uB09C \uD504\uB85C\uADF8\uB798\uBA38\uB294 \uBCF4\uD1B5 \uC815\uB3C4\uC758 \uC2E4\uB825\uC744 \uAC00\uC9C4 \uD504\uB85C\uADF8\uB798\uBA38\uC5D0 \uBE44\uD574 \uCEE4\uBBA4\uB2C8\uCF00\uC774\uC158, \uD611\uB825 \uB2A5\uB825\uC774 \uB354 \uB6F0\uC5B4\uB0A9\uB2C8\uB2E4.</p><h4 id="\u1107\u1162\u11A8\u110C\u1175\u110C\u1161\u11BC\u1103\u1169-\u1106\u1161\u11BD\u1103\u1173\u11AF\u1106\u1167\u11AB-\u110D\u1175\u11BD\u110B\u1165\u110C\u1175\u11AB\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1107\u1162\u11A8\u110C\u1175\u110C\u1161\u11BC\u1103\u1169-\u1106\u1161\u11BD\u1103\u1173\u11AF\u1106\u1167\u11AB-\u110D\u1175\u11BD\u110B\u1165\u110C\u1175\u11AB\u1103\u1161" aria-hidden="true">#</a> \uBC31\uC9C0\uC7A5\uB3C4 \uB9DE\uB4E4\uBA74 \uCC22\uC5B4\uC9C4\uB2E4?</h4><h4 id="\u1110\u1169\u11B8\u1102\u1175\u1107\u1161\u110F\u1171-\u1109\u1175\u11AF\u1112\u1165\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1110\u1169\u11B8\u1102\u1175\u1107\u1161\u110F\u1171-\u1109\u1175\u11AF\u1112\u1165\u11B7" aria-hidden="true">#</a> \uD1B1\uB2C8\uBC14\uD034 \uC2E4\uD5D8</h4><p>\uB458\uC774\uC11C \uD568\uAED8 \uC791\uC5C5\uD55C \uACBD\uC6B0 58%\uB098 \uCD94\uC0C1\uD654 \uADDC\uCE59\uC744 \uCC3E\uC544\uB0C8\uC2B5\uB2C8\uB2E4. 4\uBC30\uAC00 \uB118\uC2B5\uB2C8\uB2E4. \uB9CC\uC57D \uB450 \uC0AC\uB78C\uC774 \uD55C \uD300\uC73C\uB85C \uC791\uC5C5\uD558\uB418 \uC11C\uB85C \uC774\uB108\uB799\uC158\uD558\uC9C0 \uC54A\uC558\uACE0, \uADF8\uB4E4\uC758 \uACB0\uACFC\uBB3C \uC911 \uB354 \uB098\uC740 \uAC83\uC744 \uD0DD\uD558\uB294 \uBC29\uC2DD(\uBA85\uBAA9 \uC9D1\uB2E8(nominal group)\uC774\uB77C\uACE0 \uD568)\uC774\uB77C\uBA74? \uC774 \uACBD\uC6B0\uB294 \uD655\uB960\uC801\uC73C\uB85C \uACC4\uC0B0\uD560 \uC218 \uC788\uB294\uB370, 26%\uAC00 \uB429\uB2C8\uB2E4.</p><p>\uADF8\uB7EC\uBA74\uC11C \uB9DE\uC740\uD3B8\uC758 \uC0AC\uB78C\uACFC \uC774\uC57C\uAE30\uB97C \uD558\uB294\uB370, ... \uC774\uB7F0 \uD63C\uB3D9\uC744 \uD574\uACB0\uD558\uAE30 \uC704\uD574 \uCD94\uC0C1\uC801 \uAC1C\uB150\uC744 \uB3C4\uC785\uD569\uB2C8\uB2E4. \uC608\uCEE8\uB300 \uBC14\uD034\uC5D0 \uC2DD\uBCC4 \uBC88\uD638\uB97C \uBD99\uC778\uB2E4\uB4E0\uC9C0 \uD558\uB294 \uAC83\uC774\uC9C0\uC694.</p><p>\uB458\uC774\uC11C \uD611\uB825\uD558\uBA74\uC11C \uC791\uC5C5\uD558\uBA74 \uC11C\uB85C \uC2DC\uAC01\uC774 \uB2E4\uB974\uAE30 \uB54C\uBB38\uC5D0 \uB450 \uC0AC\uB78C\uC758 \uB2E4\uB978 \uC2DC\uAC01\uC744 \uC5F0\uACB0\uD574 \uC904 \uB2E4\uB9AC\uAC00 \uD544\uC694\uD558\uACE0, \uADF8 \uB2E4\uB9AC\uC5D0\uB294 \uD544\uC5F0\uC801\uC73C\uB85C \uCD94\uC0C1\uD654\uC758 \uC694\uC18C\uAC00 \uC788\uAC8C \uB429\uB2C8\uB2E4. \uC11C\uB85C \uB2E4\uB978 \uAC83\uB4E4\uC744 \uD558\uB098\uB85C \uBB36\uC5B4\uC57C \uD558\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4.</p><h4 id="\u110E\u116E\u1109\u1161\u11BC\u1112\u116A\u110B\u1174-\u110C\u116E\u11BC\u110B\u116D\u1109\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u110E\u116E\u1109\u1161\u11BC\u1112\u116A\u110B\u1174-\u110C\u116E\u11BC\u110B\u116D\u1109\u1165\u11BC" aria-hidden="true">#</a> \uCD94\uC0C1\uD654\uC758 \uC911\uC694\uC131</h4><p>\uB9CC\uC57D \uCF54\uB4DC\uAC00 \uBE44\uC9C0\uB2C8\uC2A4 \uB85C\uC9C1\uC774 \uB4E4\uC5B4\uAC00\uACE0 \uADF8 \uB85C\uC9C1\uC774 domain-rich \uD558\uB2E4\uBA74 \uB418\uB3C4\uB85D \uAC00\uB3C5\uC131\uC744 \uCD94\uAD6C\uD558\uACA0\uC9C0\uB9CC, \uC800\uB294 \uB54C\uB85C \uAC00\uB3C5\uC131\uC744 \uC190\uD574\uBCF4\uBA74\uC11C\uAE4C\uC9C0 \uC911\uBCF5\uC744 \uC904\uC774\uAE30\uB3C4 \uD569\uB2C8\uB2E4. ... \uD765\uBBF8\uB85C\uC6B4 \uAC1D\uCCB4\uB4E4\uC744 \uBC1C\uACAC\uD569\uB2C8\uB2E4. ... \uB0B4\uAC00 \uC804\uC5D0 \uBAA8\uB974\uB358 \uAC83\uC744 \uBC30\uC6B0\uAC8C \uB429\uB2C8\uB2E4.</p><p>&#39;\uD765\uBBF8\uB85C\uC6B4 \uBB34\uC5C7&#39;\uC774 \uBC14\uB85C \uCD94\uC0C1\uD654\uC785\uB2C8\uB2E4.</p><p>\uC778\uC6A9\uBB38 \uB300\uB85C \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uACF5\uD559\uC758 \uC5ED\uC0AC\uB294 \uC815\uB9D0 \uCD94\uC0C1\uD654\uB97C \uB192\uC774\uAE30 \uC704\uD55C \uC5EC\uC815\uC774\uC5C8\uC2B5\uB2C8\uB2E4. ... \uADF8\uB7F0\uB370 \uC6B0\uB9AC\uB294 \uC870\uAE08 \uC804 \uCD94\uC0C1\uD654\uB97C \uB192\uC77C \uC218 \uC788\uB294 \uBC29\uBC95\uC744 \uD558\uB098 \uCC3E\uC544\uB0C8\uC2B5\uB2C8\uB2E4.</p><h4 id="\u1103\u1162\u1112\u116A\u1112\u1161\u1102\u1173\u11AB-\u1111\u1173\u1105\u1169\u1100\u1173\u1105\u1162\u1106\u1175\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1103\u1162\u1112\u116A\u1112\u1161\u1102\u1173\u11AB-\u1111\u1173\u1105\u1169\u1100\u1173\u1105\u1162\u1106\u1175\u11BC" aria-hidden="true">#</a> \uB300\uD654\uD558\uB294 \uD504\uB85C\uADF8\uB798\uBC0D</h4><p><strong>\uC775\uC2A4\uD2B8\uB9BC \uD504\uB85C\uADF8\uB798\uBA38\uB294 \uC791\uC5C5\uD558\uBA74\uC11C \uD504\uB85C\uADF8\uB798\uBC0D \uAC01 \uB2E8\uACC4\uC5D0 \uB300\uD574 \uD568\uAED8 \uC774\uC57C\uAE30\uD55C\uB2E4.</strong></p><p>\uC790\uC2E0\uC774 \uC791\uC131\uD558\uB294 \uCF54\uB4DC\uC758 \uCD94\uC0C1\uC131\uC744 \uB192\uC774\uACE0 \uC2F6\uB2E4\uBA74 \uD63C\uC790\uC11C \uACE0\uBBFC\uD558\uC9C0 \uB9D0\uACE0 \uB2E4\uB978 \uC0AC\uB78C\uB4E4\uACFC \uD611\uB3D9\uD558\uACE0, \uB300\uD654\uD558\uC138\uC694. \uAC19\uC774 \uADF8\uB9BC\uB3C4 \uADF8\uB824\uBCF4\uACE0 \uD568\uAED8 \uC18C\uC2A4\uCF54\uB4DC\uB97C \uD3B8\uC9D1\uD558\uC138\uC694. \uC778\uAC04\uC5D0\uAC8C\uB294 \uB2E4\uB978 \uC778\uAC04\uACFC \uC18C\uD1B5\uD558\uACE0 \uD611\uB825\uD560 \uC218 \uC788\uB294 \uB180\uB77C\uC6B4 \uB2A5\uB825\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uB300\uD654\uB294 \uAE30\uC801\uC785\uB2C8\uB2E4.</p><h3 id="\u1109\u1175\u11AB\u1105\u116C\u1105\u1173\u11AF-\u1101\u1161\u11A9\u1102\u1173\u11AB-\u1100\u1169\u11BC\u110B\u1172\u110B\u1175\u11AB\u1100\u1161-\u1109\u1175\u11AB\u1105\u116C\u1105\u1173\u11AF-\u110A\u1161\u11C2\u1102\u1173\u11AB-\u1100\u1169\u11BC\u110B\u1172\u110B\u1175\u11AB\u1100\u1161" tabindex="-1"><a class="header-anchor" href="#\u1109\u1175\u11AB\u1105\u116C\u1105\u1173\u11AF-\u1101\u1161\u11A9\u1102\u1173\u11AB-\u1100\u1169\u11BC\u110B\u1172\u110B\u1175\u11AB\u1100\u1161-\u1109\u1175\u11AB\u1105\u116C\u1105\u1173\u11AF-\u110A\u1161\u11C2\u1102\u1173\u11AB-\u1100\u1169\u11BC\u110B\u1172\u110B\u1175\u11AB\u1100\u1161" aria-hidden="true">#</a> \uC2E0\uB8B0\uB97C \uAE4E\uB294 \uACF5\uC720\uC778\uAC00 \uC2E0\uB8B0\uB97C \uC313\uB294 \uACF5\uC720\uC778\uAC00</h3><h4 id="\u1100\u1169\u11BC\u110B\u1172-\u110C\u1169\u1100\u1165\u11AB\u1107\u1167\u11AF-\u1109\u1175\u11AB\u1105\u116C\u1103\u1169-\u1107\u1167\u11AB\u1112\u116A-\u1109\u1175\u11AF\u1112\u1165\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1100\u1169\u11BC\u110B\u1172-\u110C\u1169\u1100\u1165\u11AB\u1107\u1167\u11AF-\u1109\u1175\u11AB\u1105\u116C\u1103\u1169-\u1107\u1167\u11AB\u1112\u116A-\u1109\u1175\u11AF\u1112\u1165\u11B7" aria-hidden="true">#</a> \uACF5\uC720 \uC870\uAC74\uBCC4 \uC2E0\uB8B0\uB3C4 \uBCC0\uD654 \uC2E4\uD5D8</h4><p>\uC870\uAE08 \uCDA9\uACA9\uC801\uC778 \uC774\uC57C\uAE30\uB97C \uD574\uB4DC\uB9AC\uACA0\uC2B5\uB2C8\uB2E4. \uB450 \uACBD\uC6B0 \uBAA8\uB450 \uACF5\uC720 \uD6C4\uC5D0 <strong>\uC2E0\uB8B0\uAC10\uC774 \uB354 \uB5A8\uC5B4\uC84C\uC2B5\uB2C8\uB2E4.</strong> \uD2B9\uD788 \uCCAB \uBC88\uC9F8, \uC989 \uB514\uC790\uC778 \uD558\uB098\uB9CC \uC791\uC5C5\uD558\uACE0 \uADF8\uAC78 \uACF5\uC720\uD55C \uACBD\uC6B0\uAC00 \uB354 \uB9CE\uC774 \uB5A8\uC5B4\uC84C\uC2B5\uB2C8\uB2E4\uB9CC, \uB450 \uC870\uAC74 \uBAA8\uB450 \uC2E0\uB8B0\uAC10\uC774 \uD1B5\uACC4\uC801\uC73C\uB85C \uC720\uC758\uBBF8\uD558\uAC8C \uB5A8\uC5B4\uC84C\uC2B5\uB2C8\uB2E4. <strong>\uACF5\uC720\uB97C \uD574\uC11C \uC2E0\uB8B0\uAC00 \uB354 \uB5A8\uC5B4\uC9C0\uB294 \uC0C1\uD669</strong>\uC774 \uBC8C\uC5B4\uC9C4 \uAC83\uC774\uC8E0.</p><p>\uAC01\uC790 \uC5EC\uB7EC \uAC1C\uC758 \uB514\uC790\uC778\uC744 \uB9CC\uB4E4\uACE0 \uADF8\uAC78 \uBAA8\uB450 \uACF5\uC720\uD55C \uACBD\uC6B0\uC600\uC2B5\uB2C8\uB2E4. \uC774\uB54C\uB294 \uC2E0\uB8B0\uAC00 \uC720\uC758\uBBF8\uD558\uAC8C \uC99D\uAC00\uD588\uC2B5\uB2C8\uB2E4.</p><p>\uD558\uB098 \uACF5\uC720\uB098 \uCD5C\uACE0 \uACF5\uC720\uC758 \uACBD\uC6B0 \uC6B0\uB9AC\uB294 \uACF5\uC720 \uC790\uB9AC\uC5D0 \uAE30\uB300\uAC10\uBCF4\uB2E4 \uBD88\uC548\uAC10\uC744 \uAC16\uACE0 \uAC08 \uAC81\uB2C8\uB2E4.</p><h4 id="\u1107\u1169\u11A8\u1109\u116E-\u1100\u1169\u11BC\u110B\u1172\u110B\u1174-\u110C\u1161\u11BC\u110C\u1165\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1107\u1169\u11A8\u1109\u116E-\u1100\u1169\u11BC\u110B\u1172\u110B\u1174-\u110C\u1161\u11BC\u110C\u1165\u11B7" aria-hidden="true">#</a> \uBCF5\uC218 \uACF5\uC720\uC758 \uC7A5\uC810</h4><p>\uBCF5\uC218 \uACF5\uC720\uB294 \uADF8\uB7F0 \uBD88\uC548\uAC10\uC774 \uC0C1\uB300\uC801\uC73C\uB85C \uB35C\uD569\uB2C8\uB2E4. \uC5EC\uB7EC \uAC1C\uB97C \uC900\uBE44\uD588\uC73C\uB2C8 \uADF8\uC911 \uD558\uB098\uB97C \uB450\uACE0 \uBB50\uB77C\uACE0 \uD574\uB3C4 \uB098\uC5D0 \uB300\uD55C \uACF5\uACA9\uC740 \uC544\uB2CC \uAC81\uB2C8\uB2E4.</p><p>\uB9C8\uC9C0\uB9C9\uC73C\uB85C \uAC00\uC7A5 \uB180\uB77C\uC6B4 \uBD80\uBD84 ... \uD074\uB9AD\uB960\uC774 \uB354 \uB192\uC558\uC2B5\uB2C8\uB2E4. \uBCF5\uC218 \uACF5\uC720\uB294 (\uAC19\uC740 \uC2DC\uAC04\uC744 \uD22C\uC790\uD588\uC744 \uB54C) \uC2E0\uB8B0\uB3C4 \uB192\uC544\uC9C0\uACE0 \uC131\uACFC\uB3C4 \uB354 \uC88B\uC558\uB2E4\uB294 \uB9D0\uC785\uB2C8\uB2E4.</p><p>\uC5EC\uB7EC\uBD84\uC758 \uACF5\uC720\uB294 \uC5B4\uB5BB\uC2B5\uB2C8\uAE4C? \uC2E0\uB8B0\uB97C \uAE4E\uC544\uBA39\uB294 \uACF5\uC720\uB97C \uD558\uACE0 \uACC4\uC2E0\uAC00\uC694, \uC2E0\uB8B0\uB97C \uC313\uC544\uAC00\uB294 \uACF5\uC720\uB97C \uD558\uACE0 \uACC4\uC2E0\uAC00\uC694?</p><h3 id="\u1100\u1162\u11A8\u1100\u116A\u11AB\u1109\u1165\u11BC\u110B\u1174-\u110C\u116E\u1100\u116A\u11AB\u1109\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1100\u1162\u11A8\u1100\u116A\u11AB\u1109\u1165\u11BC\u110B\u1174-\u110C\u116E\u1100\u116A\u11AB\u1109\u1165\u11BC" aria-hidden="true">#</a> \uAC1D\uAD00\uC131\uC758 \uC8FC\uAD00\uC131</h3><p>\uC0C8\uB85C\uC6B4 \uAC1C\uB150\uC744 \uC8FC\uBCC0\uC5D0 \uC124\uB4DD\uD558\uAE30 \uC704\uD574 \uB178\uB825\uD558\uB294 \uBD84\uB4E4\uC744 \uB9CE\uC774 \uBD05\uB2C8\uB2E4.</p><p>\uADF8\uB7F0 \uBD84\uB4E4\uC744 \uB9CC\uB098\uBA74 \uC800\uB294 \uB2E4\uC74C\uACFC \uAC19\uC740 \uC9C8\uBB38\uC744 \uB358\uC9D1\uB2C8\uB2E4. &quot;\uC0C1\uB300\uBC29\uC5D0 \uB300\uD574 \uC5BC\uB9C8\uB098 \uC774\uD574\uB97C \uD558\uACE0 \uACC4\uC2E0\uAC00\uC694? \uC5BC\uB9C8\uB098 \uB300\uD654\uB97C \uD574\uBCF4\uC168\uB098\uC694?&quot;</p><p>\uAC15\uC0AC\uB294 \uC790\uC2E0\uC774 \uC88B\uC740 \uC608\uB97C \uB4E4\uC5C8\uB2E4\uACE0 \uC0DD\uAC01\uD569\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC9C8\uBB38\uC790\uB294 \uADF8\uB807\uAC8C \uC0DD\uAC01\uD558\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4. &#39;\uC608&#39;\uC758 \uC815\uC774\uAC00 \uC8FC\uAD00\uC801\uC774\uB77C \uBC8C\uC5B4\uC9C4 \uC77C\uC774\uC8E0.</p><h4 id="\u1111\u116E\u11B7\u110C\u1175\u11AF\u110B\u1173\u11AB-\u1109\u1161\u11BC\u1103\u1162\u110C\u1165\u11A8\u110B\u1175\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1111\u116E\u11B7\u110C\u1175\u11AF\u110B\u1173\u11AB-\u1109\u1161\u11BC\u1103\u1162\u110C\u1165\u11A8\u110B\u1175\u1103\u1161" aria-hidden="true">#</a> \uD488\uC9C8\uC740 \uC0C1\uB300\uC801\uC774\uB2E4</h4><p>\uD488\uC9C8 \uC804\uBB38\uAC00 \uC81C\uB7F4\uB4DC \uC640\uC778\uBC84\uADF8\uB294 \uD488\uC9C8\uC744 \uB2E4\uC74C\uACFC \uAC19\uC774 \uC815\uC758\uD569\uB2C8\uB2E4.</p><blockquote><p>\uD488\uC9C8\uC774\uB780 \uB204\uAD70\uAC00\uC5D0\uAC8C \uAC00\uCE58\uAC00 \uB418\uB294 \uAC83\uC774\uB2E4.</p></blockquote><p>\uC6B0\uB9AC\uAC00 \uC77C\uBC18\uC801\uC73C\uB85C \uB4E3\uB294 \uD488\uC9C8\uC758 \uC815\uC774\uC640 \uB2E4\uB974\uC8E0? ... \uADF8\uB7F0 \uC815\uC758\uB4E4\uC740 \uB9E4\uC6B0 \uD50C\uB77C\uD1A4\uC801\uC785\uB2C8\uB2E4. \uBB54\uAC00 \uACE0\uC0C1\uD558\uACE0 \uC644\uBCBD\uD55C \uD488\uC9C8\uC774\uB77C\uB294 \uAC83\uC774 \uD558\uB298 \uC5B4\uB518\uAC00\uC5D0 \uC788\uB294 \uAC83\uCC98\uB7FC \uB4E4\uB9BD\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC640\uC778\uBC84\uADF8\uC758 \uC815\uC758\uB294 \uC0C1\uB300\uC8FC\uC758\uC801\uC774\uBA70 \uB3D9\uC2DC\uC5D0 \uBB34\uCC99 \uC2E4\uC6A9\uC801\uC785\uB2C8\uB2E4.</p><p>\uC6B0\uB9AC\uAC00 \uD488\uC9C8\uC744 \uC774\uC57C\uAE30\uD560 \uB54C\uC5D0\uB294 &#39;\uB204\uAD6C&#39;\uB97C \uB193\uACE0 \uD558\uB294 \uB9D0\uC774\uB0D0\uB294 \uAC78 \uC0DD\uAC01\uD574 \uBD10\uC57C \uD55C\uB2E4 \uC774\uAC81\uB2C8\uB2E4.</p><p><strong>\uACB0\uAD6D \uACB0\uC815\uD558\uB294 \uAC83\uC740 \uC0AC\uB78C\uC785\uB2C8\uB2E4.</strong></p><h4 id="\u1100\u1161\u11B7\u110C\u1165\u11BC\u110B\u1173\u11AF-\u1107\u1162\u110C\u1166\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1165\u11B9\u1103\u1161" tabindex="-1"><a class="header-anchor" href="#\u1100\u1161\u11B7\u110C\u1165\u11BC\u110B\u1173\u11AF-\u1107\u1162\u110C\u1166\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1165\u11B9\u1103\u1161" aria-hidden="true">#</a> \uAC10\uC815\uC744 \uBC30\uC81C\uD560 \uC218 \uC5C6\uB2E4</h4><p>\uADF8\uB9AC\uACE0 \uB17C\uB9AC\uB791 \uAC10\uC815\uC801 \uD310\uB2E8\uC744 \uBD84\uB9AC\uD560 \uC218\uAC00 \uC5C6\uC2B5\uB2C8\uB2E4.</p><p><strong>\uC758\uC0AC\uACB0\uC815\uC744 \uD558\uB294 \uACFC\uC815\uC5D0 \uAC10\uC815\uC801\uC774\uACE0 \uC9C1\uAD00\uC801\uC778 \uBD80\uBD84\uC774 \uD070 \uC5ED\uD560\uC744 \uD558\uACE0 \uC788\uC73C\uBA70, \uADF8\uB7F0 \uAC10\uC815\uC801 \uBD80\uBD84\uC774 \uBC30\uC81C\uB41C\uB2E4\uBA74 \uC758\uC0AC\uACB0\uC815\uC744 \uC81C\uB300\uB85C \uD560 \uC218 \uC5C6\uB2E4</strong>\uB294 \uAC83\uC744 \uC54C \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p><p>\uB0A8\uC744 \uC124\uB4DD\uD558\uB824\uBA74 \uB17C\uB9AC\uC131\uACFC \uAC1D\uAD00\uC131\uC5D0 \uB300\uD55C \uD658\uC0C1\uC744 \uBC84\uB824\uC57C \uD569\uB2C8\uB2E4. \uADF8\uB798\uC57C \uD604\uC2E4\uC801\uC73C\uB85C \uC124\uB4DD\uC774 \uAC00\uB2A5\uD569\uB2C8\uB2E4. \uB0B4\uAC00 \uC124\uB4DD\uD558\uACE0 \uC2F6\uC740 \uC0C1\uB300\uB97C \uC790\uC8FC \uB9CC\uB098\uC11C \uC2E0\uB8B0\uB97C \uC313\uACE0, \uADF8 \uC0AC\uB78C\uC774 \uBB34\uC5C7\uC744 \uC911\uC694\uD558\uAC8C \uC5EC\uAE30\uB294\uC9C0, \uC5B4\uB5A4 \uC124\uBA85 \uBC29\uC2DD\uC744 \uC120\uD638\uD558\uB294\uC9C0 \uC774\uD574\uD574\uC57C \uD569\uB2C8\uB2E4.</p><h4 id="\u1109\u1165\u11BC\u1112\u1163\u11BC\u1100\u116A-\u1100\u1175\u110C\u1175\u11AF\u110B\u1166-\u1104\u1161\u1105\u1173\u11AB-\u110B\u1162\u110C\u1161\u110B\u1175\u11AF-\u1109\u1165\u11AF\u1106\u1167\u11BC\u1107\u1165\u11B8" tabindex="-1"><a class="header-anchor" href="#\u1109\u1165\u11BC\u1112\u1163\u11BC\u1100\u116A-\u1100\u1175\u110C\u1175\u11AF\u110B\u1166-\u1104\u1161\u1105\u1173\u11AB-\u110B\u1162\u110C\u1161\u110B\u1175\u11AF-\u1109\u1165\u11AF\u1106\u1167\u11BC\u1107\u1165\u11B8" aria-hidden="true">#</a> \uC131\uD5A5\uACFC \uAE30\uC9C8\uC5D0 \uB530\uB978 \uC560\uC790\uC77C \uC124\uBA85\uBC95</h4><p>\uACB0\uB860\uC740, \uAC1D\uAD00\uC131\uC774\uB77C\uACE0 \uD558\uB294 \uAC83\uC740 \uC0C1\uB300\uC801\uC774\uBA70, \uB0B4\uAC00 \uC0DD\uAC01\uD558\uB294 \uAC1D\uAD00\uC774 \uC0C1\uB300\uC758 \uAC1D\uAD00\uC774 \uC544\uB2D0 \uC218 \uC788\uACE0, \uADF8\uB807\uAE30 \uB54C\uBB38\uC5D0 \uC124\uB4DD\uC5D0 \uC131\uACF5\uD558\uB824\uBA74 \uC6B0\uC120 \uADF8 \uC0AC\uB78C\uC744 \uC774\uD574\uD558\uB294 \uAC83\uC5D0\uC11C \uCD9C\uBC1C\uD574\uC57C \uD55C\uB2E4\uB294 \uB9D0\uC785\uB2C8\uB2E4.</p><h3 id="\u110B\u1175\u1100\u1165\u11BA\u1103\u1169-\u1106\u1169\u1105\u1173\u1109\u1166\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u1100\u1165\u11BA\u1103\u1169-\u1106\u1169\u1105\u1173\u1109\u1166\u110B\u116D" aria-hidden="true">#</a> \uC774\uAC83\uB3C4 \uBAA8\uB974\uC138\uC694?</h3><h4 id="\u1100\u1169\u11BC\u1100\u1161\u11B7\u1112\u1161\u1100\u1169-\u110B\u1175\u1112\u1162\u1112\u1161\u1105\u1167\u1102\u1173\u11AB-\u1103\u1162\u1112\u116A" tabindex="-1"><a class="header-anchor" href="#\u1100\u1169\u11BC\u1100\u1161\u11B7\u1112\u1161\u1100\u1169-\u110B\u1175\u1112\u1162\u1112\u1161\u1105\u1167\u1102\u1173\u11AB-\u1103\u1162\u1112\u116A" aria-hidden="true">#</a> \uACF5\uAC10\uD558\uACE0 \uC774\uD574\uD558\uB824\uB294 \uB300\uD654</h4><p>\uC774\uB7F0 \uACFC\uC815\uC744 \uAC70\uCE58\uBA74 \uD64D\uCD98\uC774\uC758 \uBA38\uB9BF\uC18D\uC5D0\uB294 \uC5B4\uB5A4 \uADF8\uB9BC\uC774 \uB5A0\uC624\uB97C\uAE4C\uC694? ... \uC220\uD37C\uB9E8\uC758 \uBA38\uB9BF\uC18D \uC9C0\uB3C4\uC640 \uC0AC\uACE0 \uD750\uB984\uC744 \uC5FF\uBCF4\uAC8C \uB418\uB294 \uAC83\uC774\uC8E0.</p><p>\uADF8 \uC0AC\uB78C\uC774 \uC774 \uC0C1\uD669\uC5D0\uC11C \uC65C \uC774\uB7F0 \uC811\uADFC\uC744 \uD560 \uC218\uBC16\uC5D0 \uC5C6\uC5C8\uB294\uC9C0 \uC54C\uAE30 \uB54C\uBB38\uC5D0 \uC880 \uB354 \uC815\uD655\uD558\uACE0 \uD6A8\uACFC\uC801\uC778 \uC81C\uC548\uC744 \uD574\uC904 \uC218 \uC788\uC2B5\uB2C8\uB2E4. ... \uB610, \uC18C\uC704 \uC554\uBB35\uC9C0\uB77C\uACE0 \uBD80\uB974\uB294 \uAC83\uB4E4\uC744 \uC804\uB2EC\uD574\uC904 \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4.</p><h4 id="\u1112\u1162\u11BC\u1103\u1169\u11BC\u110B\u1173\u11AF-\u110B\u1172\u1103\u1169\u1112\u1161\u1102\u1173\u11AB-\u1103\u1162\u1112\u116A" tabindex="-1"><a class="header-anchor" href="#\u1112\u1162\u11BC\u1103\u1169\u11BC\u110B\u1173\u11AF-\u110B\u1172\u1103\u1169\u1112\u1161\u1102\u1173\u11AB-\u1103\u1162\u1112\u116A" aria-hidden="true">#</a> \uD589\uB3D9\uC744 \uC720\uB3C4\uD558\uB294 \uB300\uD654</h4><blockquote><p>\uC220\uD37C\uB9E8 : \uB124, \uADF8\uB7EC\uACE0 \uC2F6\uC5B4\uC694. \uADF8\uB7F0\uB370 \uC5B8\uC820\uAC00 \uD55C\uBC88 \uB9C8\uC74C\uBA39\uACE0 \uC81C\uB300\uB85C \uACF5\uBD80\uD574\uC57C\uC9C0, \uD574\uC57C\uC9C0 \uD558\uACE0 \uC0DD\uAC01\uD558\uBA74\uC11C \uBA87 \uB2EC\uC9F8 \uBBF8\uB8E8\uACE0 \uC788\uB294 \uAC83 \uAC19\uC544\uC694.</p><p>\uD64D\uCD98\uC774 : \uC815\uADDC\uC2DD\uC744 \uBC30\uC6CC\uC11C \uD574\uBCF4\uACE0 \uC2F6\uC740 \uAC83\uB4E4\uC774 \uC788\uB098\uBD10\uC694. ...</p></blockquote><p>\uCC38\uACE0\uB85C \uCF54\uCE6D\uC758 \uD765\uBBF8\uB85C\uC6B4 \uC810\uC740 \uCF54\uCE58 \uC790\uC2E0(\uD64D\uCD98\uC774)\uC774 \uD574\uB2F9 \uC601\uC5ED(\uC815\uADDC\uC2DD)\uC5D0 \uB300\uD55C \uC804\uBB38\uC9C0\uC2DD\uC774 \uC5C6\uC5B4\uB3C4 \uCF54\uCE6D\uC744 \uD560 \uC218 \uC788\uB2E4\uB294 \uC810\uC785\uB2C8\uB2E4.</p><h3 id="\u1112\u1161\u1112\u1163\u11BC\u1109\u1175\u11A8-\u110C\u1165\u11B8\u1100\u1173\u11AB\u110B\u1174-\u1112\u1161\u11B7\u110C\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1112\u1161\u1112\u1163\u11BC\u1109\u1175\u11A8-\u110C\u1165\u11B8\u1100\u1173\u11AB\u110B\u1174-\u1112\u1161\u11B7\u110C\u1165\u11BC" aria-hidden="true">#</a> \uD558\uD5A5\uC2DD \uC811\uADFC\uC758 \uD568\uC815</h3><p>\uB300\uBD80\uBD84\uC758 \uAE30\uC5C5\uC5D0\uC11C \uC9C1\uC6D0 \uC22B\uC790\uAC00 \uB298\uC5B4\uB098\uAE30 \uC2DC\uC791\uD558\uBA74 \uCD94\uC0C1 \uCE35\uC704\uC5D0 \uB530\uB77C \uD300\uC744 \uB098\uB215\uB2C8\uB2E4. \uAC01 \uCE35\uC704\uC758 \uC804\uBB38\uAC00 \uD300\uC774 \uC874\uC7AC\uD569\uB2C8\uB2E4. \uAE30\uD68D\uD300, \uAD6C\uD604\uD300, QA\uD300 \uB4F1, \uADF8\uB9AC\uACE0 \uC77C\uC774 \uC9C4\uD589\uB428\uC5D0 \uB530\uB77C \uD300 \uAC04\uC758 \uBC14\uD1B5 \uD130\uCE58\uAC00 \uC774\uB8E8\uC5B4\uC9D1\uB2C8\uB2E4. \uC704\uC5D0\uC11C \uC544\uB798 \uBC29\uD5A5\uC73C\uB85C\uC694.</p><p>\uADF8\uB7FC \uBAA8\uB4E0 \uBB38\uC81C\uB97C \uD0D1\uB2E4\uC6B4 \uC2DD\uC73C\uB85C \uD478\uB294 \uAC83\uC774 \uC6B0\uB9AC\uC758 \uC9C0\uD5A5\uC810\uC77C\uAE4C\uC694? \uC778\uACF5\uC9C0\uB2A5 \uC5F0\uAD6C\uC5D0\uC120 \uC774 \uC138\uC0C1\uC758 \uBB38\uC81C\uB97C \uB450 \uC885\uB958\uB85C \uB098\uB215\uB2C8\uB2E4. \uC798 \uC815\uC758\uB41C \uBB38\uC81C\uC640 \uC798 \uC815\uC758\uB418\uC9C0 \uC54A\uC740 \uBB38\uC81C ... \uC624\uBAA9\uC774\uB098 \uCCB4\uC2A4 ... \uC5EC\uAE30\uC5D0 \uC18D\uD569\uB2C8\uB2E4.</p><p>\uD558\uC9C0\uB9CC \uC6B0\uB9AC\uAC00 \uC2E4\uC0DD\uD65C\uC5D0\uC11C \uB9CC\uB098\uB294 \uB300\uB2E4\uC21C\uC758 \uBB38\uC81C\uB294 \uC798 \uC815\uC758\uB418\uC9C0 \uC54A\uC740 \uBB38\uC81C\uC785\uB2C8\uB2E4.</p><p>\uC55E\uC11C\uC758 \uC804\uBB38\uAC00\uB4E4\uC740 ... \uC798 \uC815\uC758\uB418\uC9C0 \uC54A\uC740 \uBB38\uC81C\uB97C \uC811\uD558\uBA74 \uC811\uADFC\uBC95\uC744 \uBC14\uAFC9\uB2C8\uB2E4. \uD0D1\uB2E4\uC6B4\uACFC \uBC14\uD140\uC5C5\uC744 \uC11E\uC5B4 \uC501\uB2C8\uB2E4. \uB6F0\uC5B4\uB09C \uC804\uBB38\uAC00\uC77C\uC218\uB85D \uB354\uC6B1 \uADF8\uB7EC\uD569\uB2C8\uB2E4.</p><p>\uD2B9\uD788 \uD0D1\uB2E4\uC6B4\uACFC \uBC14\uD140\uC5C5\uC758 \uBC29\uD5A5\uC774 \uC804\uD658\uB418\uB294 \uC2DC\uC810\uB4E4\uC5D0\uC11C &#39;\uC544\uD558 \uC21C\uAC04&#39;\uC774 \uCC3E\uC544\uC654\uC2B5\uB2C8\uB2E4.</p><p>&quot;\uC774\uBC88 \uC77C\uC740 \uBCF5\uC7A1\uD558\uACE0 \uBD88\uD655\uC2E4\uD558\uB2C8\uAE4C \uCCA0\uC800\uD558\uAC8C \uACC4\uD68D\uD558\uACE0 \uB2E8\uACC4\uC801\uC73C\uB85C \uC811\uADFC\uD558\uC790!&quot; \uC774 \uB9D0\uC740 \uACE7, \uC774\uBC88 \uC77C\uC740 \uBD88\uD655\uC2E4\uD558\uB2C8\uAE4C \uCD08\uBCF4\uCC98\uB7FC \uC77C\uD558\uC790\uB294 \uB9D0\uACFC \uB611\uAC19\uC2B5\uB2C8\uB2E4.</p><p>\uC624\uD788\uB824 \uC804\uBB38\uAC00\uC77C\uC218\uB85D \uC790\uC2E0\uC758 \uACC4\uD68D\uC744 \uC218\uC815\uD55C \uD69F\uC218\uAC00 \uB9CE\uC558\uC2B5\uB2C8\uB2E4.</p><p>\uC5F0\uAD6C\uC5D0 \uB530\uB974\uBA74, \uD504\uB85C\uADF8\uB7A8\uC744 \uC774\uD574\uD560 \uB54C \uACE0\uC218\uB294 \uC0C1\uD638 \uCC38\uC870 \uC804\uB7B5\uC744 \uC4F0\uB294 \uBC18\uBA74 \uD558\uC218\uB294 \uADF8\uB807\uC9C0 \uC54A\uC558\uC2B5\uB2C8\uB2E4.</p><p>\uACE0\uC218\uB294 ... \uD504\uB85C\uADF8\uB7A8\uC5D0\uC11C \uC774\uD574\uD55C \uAC83\uC744 \uB3C4\uBA54\uC778 \uC5B4\uD718\uB85C \uBC88\uC5ED\uD569\uB2C8\uB2E4. \uADF8\uB7EC\uACE0\uB294 \uB3C4\uBA54\uC778 \uC5B4\uD718\uB97C \uD504\uB85C\uADF8\uB7A8\uC0C1\uC758 \uC5B4\uD718\uB85C \uB2E4\uC2DC \uBC14\uAFD4\uC11C \uAC80\uC99D\uD569\uB2C8\uB2E4. \uC774\uB97C \uC0C1\uD638 \uCC38\uC870 \uC804\uB7B5\uC774\uB77C\uACE0 \uD569\uB2C8\uB2E4.</p><h4 id="\u1108\u1161\u1105\u1173\u1100\u1169-\u1107\u1175\u11AB\u1107\u1165\u11AB\u1112\u1161\u11AB-\u1107\u1161\u1110\u1169\u11BC-\u1110\u1165\u110E\u1175\u1100\u1161-\u1100\u1161\u1102\u1173\u11BC\u1112\u1161\u11AB-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161-\u110C\u1169\u110C\u1175\u11A8" tabindex="-1"><a class="header-anchor" href="#\u1108\u1161\u1105\u1173\u1100\u1169-\u1107\u1175\u11AB\u1107\u1165\u11AB\u1112\u1161\u11AB-\u1107\u1161\u1110\u1169\u11BC-\u1110\u1165\u110E\u1175\u1100\u1161-\u1100\u1161\u1102\u1173\u11BC\u1112\u1161\u11AB-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161-\u110C\u1169\u110C\u1175\u11A8" aria-hidden="true">#</a> \uBE60\uB974\uACE0 \uBE48\uBC88\uD55C \uBC14\uD1B5 \uD130\uCE58\uAC00 \uAC00\uB2A5\uD55C \uC804\uBB38\uAC00 \uC870\uC9C1</h4><p><strong>\uC0BC\uD22C\uC555\uC801 \uC758\uC0AC\uC18C\uD1B5</strong></p><p>\uC0AC\uB78C\uB4E4\uC774 \uBB3C\uB9AC\uC801\uC73C\uB85C \uAC00\uAE4C\uC6B4 \uAC70\uB9AC\uC5D0 \uC788\uC5B4\uC57C \uC720\uB9AC\uD558\uACA0\uC8E0.</p><p>\uADF8\uB9AC\uACE0 \uD55C\uBC88\uC5D0 \uCC98\uB9AC\uB418\uB294 \uC77C\uC758 \uC591(batch size)\uC744 \uC904\uC5EC\uC57C \uD569\uB2C8\uB2E4. \uBC30\uCE58 \uC0AC\uC774\uC988\uB97C \uC904\uC5EC\uC11C \uC9C0\uC18D\uC801 \uD750\uB984\uC744 \uB9CC\uB4E4\uACE0 \uC9E7\uC740 \uC2DC\uAC04 \uB0B4\uC5D0 \uD0D1, \uBC14\uD140\uC744 \uC624\uAC00\uAC8C \uD569\uB2C8\uB2E4. \uC608\uB97C \uB4E4\uC5B4 \uC804\uC5D0\uB294 \uB514\uC790\uC774\uB108\uAC00 100\uAC1C\uC758 \uC77C\uC790\uB9AC\uB97C \uB2E4 \uCC98\uB9AC\uD55C \uD6C4\uC5D0 \uD55C\uAEBC\uBC88\uC5D0 \uBAA8\uC544 \uACB0\uACFC\uB97C \uC804\uB2EC\uD588\uB2E4\uBA74 \uC810\uCC28 50\uAC1C\uB85C, 10\uAC1C\uB85C, 1\uAC1C\uB85C \uB0AE\uCD94\uC5B4\uC57C \uD569\uB2C8\uB2E4.</p><p>\uC5B4\uB290 \uD55C \uB2E8\uACC4\uB97C \uD55C\uBC88\uC5D0 \uC644\uB8CC\uD558\uB294 \uAC83\uC740 \uB354 \uB0AE\uC740 \uD488\uC9C8\uB85C \uAC00\uB294 \uC9C0\uB984\uAE38\uC785\uB2C8\uB2E4.</p><p>\uD754\uD788\uB4E4 \uB9D0\uD558\uB294 \uAC1C\uBC1C\uC758 5\uB2E8\uACC4\uB3C4 \uBE44\uC2B7\uD569\uB2C8\uB2E4. ... \uC5B4\uB5BB\uAC8C \uD574\uC57C \uCCAB \uB2EC\uBD80\uD130, \uC544\uB2C8 \uCCAB \uC8FC\uBD80\uD130 \uBD84\uC11D, \uC124\uACC4, \uAD6C\uD604, \uD14C\uC2A4\uD2B8, \uC804\uAC1C\uB97C \uBAA8\uB450 \uC654\uB2E4\uAC14\uB2E4\uD560 \uC218 \uC788\uC744\uAE4C\uB97C \uACE0\uBBFC\uD574\uC57C \uD560 \uAC83\uC785\uB2C8\uB2E4.</p><h3 id="\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161-\u1110\u1175\u11B7\u110B\u1175-\u1109\u1175\u11AF\u1111\u1162\u1112\u1161\u1102\u1173\u11AB-\u110B\u1175\u110B\u1172" tabindex="-1"><a class="header-anchor" href="#\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161-\u1110\u1175\u11B7\u110B\u1175-\u1109\u1175\u11AF\u1111\u1162\u1112\u1161\u1102\u1173\u11AB-\u110B\u1175\u110B\u1172" aria-hidden="true">#</a> \uC804\uBB38\uAC00 \uD300\uC774 \uC2E4\uD328\uD558\uB294 \uC774\uC720</h3><p>\uD68C\uC0AC\uC5D0\uC11C\uC758 \uC62C\uC2A4\uD0C0\uB294 \uC5B4\uB5A8\uAE4C\uC694? ... \uC2A4\uD0C0\uB4E4\uC774 \uD55C \uBA85\uC529 \uD300\uC5D0 \uCD94\uAC00\uB420 \uB584\uB9C8\uB2E4 \uD300\uC758 \uCD94\uAC00\uC801 \uC131\uACFC \uD5A5\uC0C1\uC740 \uD55C\uACC4\uD6A8\uC6A9\uC744 \uBCF4\uC774\uBA70 \uC5B4\uB290 \uC218\uC900\uC744 \uC9C0\uB098\uBA74 \uC74C\uC758 \uBC29\uD5A5\uC73C\uB85C \uC791\uC6A9\uD55C\uB2E4\uACE0 \uD569\uB2C8\uB2E4.</p><p>\uC804\uBB38\uAC00\uAC00 \uCD94\uAC00\uB418\uB294\uAC8C \uB3C4\uC6C0\uC774 \uC548 \uB418\uAC70\uB098 \uC624\uD788\uB824 \uC131\uACFC\uB97C \uAE4E\uC544\uBA39\uB294 \uACBD\uD5A5\uC740 \uD2B9\uD788\uB098 \uC804\uBB38\uAC00\uB4E4\uC758 \uC804\uBB38\uC131\uC774 \uC11C\uB85C \uC720\uC0AC\uD560 \uB584 \uB3C4\uB4DC\uB77C\uC84C\uC2B5\uB2C8\uB2E4.</p><p>\uC790\uAE30\uB4E4\uC774 \uC54C\uC544\uC11C \uD558\uAC8C \uB194\uB454 \uC804\uBB38\uAC00\uD300\uC740 <strong>\uBE44\uC804\uBB38\uAC00\uB85C\uB9CC \uAD6C\uC131\uB41C \uD300\uBCF4\uB2E4\uB3C4 \uD6E8\uC52C \uBABB\uD55C \uACB0\uACFC</strong>\uAC00 \uB098\uC654\uC2B5\uB2C8\uB2E4.</p><p>\uD300 \uB0B4\uC5D0 \uAC1C\uC778 \uB0B4 \uB2E4\uC591\uC131\uC774 \uB192\uC740 \uBA64\uBC84\uAC00 \uC5C6\uB2E4\uBA74 \uC804\uBB38\uAC00\uB85C \uAD6C\uC131\uB41C \uD300\uC740 \uC815\uBCF4 \uACF5\uC720\uAC00 \uC798 \uC548 \uB418\uC5B4\uC11C \uC131\uACFC\uAC00 \uB5A8\uC5B4\uC9C8 \uC218 \uC788\uB2E4\uB294 \uBD84\uC11D\uC744 \uD588\uC2B5\uB2C8\uB2E4.</p><h3 id="\u1100\u116E\u1100\u1173\u11AF\u110B\u1175-\u1107\u1161\u11B0\u1112\u1175\u11AB-\u1110\u1161\u11A8\u110B\u116F\u11AF\u1112\u1161\u11AB-\u1110\u1175\u11B7\u110B\u1174-\u1107\u1175\u1106\u1175\u11AF" tabindex="-1"><a class="header-anchor" href="#\u1100\u116E\u1100\u1173\u11AF\u110B\u1175-\u1107\u1161\u11B0\u1112\u1175\u11AB-\u1110\u1161\u11A8\u110B\u116F\u11AF\u1112\u1161\u11AB-\u1110\u1175\u11B7\u110B\u1174-\u1107\u1175\u1106\u1175\u11AF" aria-hidden="true">#</a> \uAD6C\uAE00\uC774 \uBC1D\uD78C \uD0C1\uC6D4\uD55C \uD300\uC758 \uBE44\uBC00</h3><p>\uC81C\uAC00 \uBD24\uC744 \uB584 \uC911\uC694\uD55C \uBD80\uBD84\uC740 \uC138 \uAD70\uB370\uC785\uB2C8\uB2E4.</p><ol><li><p>\uD300\uC5D0 \uB204\uAC00 \uC788\uB294\uC9C0(\uC804\uBB38\uAC00, \uB0B4\uD5A5/\uC678\uD5A5, \uC9C0\uB2A5 \uB4F1)\uBCF4\uB2E4 <strong>\uD300\uC6D0\uB4E4\uC774 \uC11C\uB85C \uC5B4\uB5BB\uAC8C \uC0C1\uD638\uC791\uC6A9\uD558\uACE0 \uC790\uC2E0\uC758 \uC77C\uC744 \uC5B4\uB5BB\uAC8C \uBC14\uB77C\uBCF4\uB294\uC9C0\uAC00 \uD6E8\uC52C \uC911\uC694</strong>\uD588\uB2E4.</p></li><li><p>5\uAC00\uC9C0 \uC131\uACF5\uC801 \uD300\uC758 \uD2B9\uC9D5\uC744 \uCC3E\uC558\uB294\uB370, \uADF8\uC911 \uC555\uB3C4\uC801\uC73C\uB85C \uB192\uC740 \uC608\uCE21\uB825\uC744 \uBCF4\uC778 \uBCC0\uC218\uB294 \uD300\uC758 <strong>\uC2EC\uB9AC\uC801 \uC548\uC804\uAC10</strong>\uC774\uC5C8\uB2E4.</p></li><li><p>\uD300 \uD1A0\uB860 \uB4F1 \uD2B9\uBCC4\uD788 \uACE0\uC548\uB41C \uD65C\uB3D9\uC744 \uD1B5\uD574 <strong>\uC2EC\uB9AC\uC801 \uC548\uC804\uAC10\uC744 \uAC1C\uC120\uD560 \uC218 \uC788\uC5C8\uB2E4.</strong></p></li></ol><p>\uC5EC\uAE30\uC5D0\uC11C \uB9D0\uD558\uB294 \uC2EC\uB9AC\uC801 \uC548\uC804\uAC10\uC774\uB780, \uB0B4 \uC0DD\uAC01\uC774\uB098 \uC758\uACAC, \uC9C8\uBB38, \uAC71\uC815, \uD639\uC740 \uC2E4\uC218\uAC00 \uB4DC\uB7EC\uB0AC\uC744 \uB54C \uCC98\uBC8C\uBC1B\uAC70\uB098 \uB180\uB9BC\uBC1B\uC9C0 \uC54A\uC744 \uAC70\uB77C\uB294 \uBBFF\uC74C\uC744 \uB9D0\uD569\uB2C8\uB2E4.</p><p>\uC5D0\uB4DC\uBAAC\uB4DC\uC2A8\uC740 \uC774\uB7F0 \uB3C4\uAD6C\uB97C \uC0AC\uC6A9\uD574 \uBCD1\uC6D0\uC758 \uC911\uD658\uC790\uC2E4\uC758 \uC2EC\uB9AC\uC801 \uC548\uC804\uAC10\uC744 \uCE21\uC815\uD574 \uBCF4\uC558\uC2B5\uB2C8\uB2E4. ... \uC608\uC0C1\uACFC \uBE44\uC2B7\uD558\uAC8C, \uC9C1\uC704\uC5D0 \uB530\uB77C \uB290\uB07C\uB294 \uC2EC\uB9AC\uC801 \uC548\uC804\uAC10\uC5D0 \uD1B5\uACC4\uC801\uC73C\uB85C \uC720\uC758\uBBF8\uD55C \uCC28\uC774\uAC00 \uC788\uC5C8\uC2B5\uB2C8\uB2E4.</p><p>\uC2EC\uB9AC\uC801 \uC548\uC804\uAC10\uC774 \uB192\uC740 \uBCD1\uC2E4\uC5D0\uC11C\uB294 ... 18%\uB098 \uB0AE\uC740 \uC0AC\uB9DD\uB960\uC744 \uBCF4\uC600\uC2B5\uB2C8\uB2E4.</p><p>\uD300\uC6D0\uC774 \uBD88\uD3B8\uD55C \uBB38\uC81C\uB97C \uC81C\uAE30\uD558\uAC70\uB098, \uC5B4\uB9AC\uC11D\uC5B4 \uBCF4\uC774\uB294 \uC9C8\uBB38\uC744 \uD558\uAC70\uB098, \uBD80\uC871\uD55C \uC758\uACAC\uC744 \uC598\uAE30\uD558\uAC70\uB098, \uC5B4\uCC98\uAD6C\uB2C8\uC5C6\uB294 \uC2E4\uC218\uB97C \uC800\uC9C0\uB97C \uB54C \uC5EC\uB7EC\uBD84\uC740 \uC5B4\uB5A4 \uB9C8\uC774\uD06C\uB85C \uC778\uD130\uB799\uC158\uC744 \uBCF4\uC5EC\uC8FC\uACE0 \uACC4\uC2E0\uAC00\uC694?</p><h3 id="\u110F\u116B\u1109\u1169\u11A8-\u1112\u1161\u11A8\u1109\u1173\u11B8\u1110\u1175\u11B7" tabindex="-1"><a class="header-anchor" href="#\u110F\u116B\u1109\u1169\u11A8-\u1112\u1161\u11A8\u1109\u1173\u11B8\u1110\u1175\u11B7" aria-hidden="true">#</a> \uCF8C\uC18D \uD559\uC2B5\uD300</h3><h4 id="\u110E\u116C\u1109\u1169-\u110E\u1175\u11B7\u1109\u1173\u11B8-\u1109\u1175\u11B7\u110C\u1161\u11BC-\u1109\u116E\u1109\u116E\u11AF" tabindex="-1"><a class="header-anchor" href="#\u110E\u116C\u1109\u1169-\u110E\u1175\u11B7\u1109\u1173\u11B8-\u1109\u1175\u11B7\u110C\u1161\u11BC-\u1109\u116E\u1109\u116E\u11AF" aria-hidden="true">#</a> \uCD5C\uC18C \uCE68\uC2B5 \uC2EC\uC7A5 \uC218\uC220</h4><p>\uB17C\uBB38 \uC81C\uBAA9\uC740 &lt;\uD300 \uD559\uC2B5\uC758 \uC18D\uB3C4 \uB192\uC774\uAE30&gt;\uC785\uB2C8\uB2E4. \uCD5C\uC18C \uCE68\uC2B5 \uC2EC\uC7A5 \uC218\uC220\uBC95\uC744 \uC5B4\uB5A4 \uD300\uC774 \uBE68\uB9AC \uC775\uD788\uB294\uAC00 \uD558\uB294 \uAC83\uC774 \uC8FC\uC81C\uC785\uB2C8\uB2E4.</p><p>\uD558\uC9C0\uB9CC \uB180\uB77C\uC6B4 \uC810\uC740 \uC218\uC220 \uC2DC\uAC04 \uAC10\uC18C\uC728\uC774 \uD300\uB9C8\uB2E4 \uCC9C\uCC28\uB9CC\uBCC4\uC774\uC5C8\uB2E4\uB294 \uAC81\uC785\uB2C8\uB2E4.</p><h4 id="\u1112\u1161\u11A8\u1109\u1173\u11B8-\u1109\u1169\u11A8\u1103\u1169\u110B\u116A-\u1109\u1161\u11BC\u1100\u116A\u11AB\u110B\u1165\u11B9\u1102\u1173\u11AB-\u1100\u1165\u11BA" tabindex="-1"><a class="header-anchor" href="#\u1112\u1161\u11A8\u1109\u1173\u11B8-\u1109\u1169\u11A8\u1103\u1169\u110B\u116A-\u1109\u1161\u11BC\u1100\u116A\u11AB\u110B\u1165\u11B9\u1102\u1173\u11AB-\u1100\u1165\u11BA" aria-hidden="true">#</a> \uD559\uC2B5 \uC18D\uB3C4\uC640 \uC0C1\uAD00\uC5C6\uB294 \uAC83</h4><h4 id="\u1105\u1175\u1103\u1165\u1100\u1161-\u1110\u1175\u11B7-\u1112\u1161\u11A8\u1109\u1173\u11B8-\u1109\u1169\u11A8\u1103\u1169\u110B\u1166-\u1106\u1175\u110E\u1175\u1102\u1173\u11AB-\u110B\u1167\u11BC\u1112\u1163\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1105\u1175\u1103\u1165\u1100\u1161-\u1110\u1175\u11B7-\u1112\u1161\u11A8\u1109\u1173\u11B8-\u1109\u1169\u11A8\u1103\u1169\u110B\u1166-\u1106\u1175\u110E\u1175\u1102\u1173\u11AB-\u110B\u1167\u11BC\u1112\u1163\u11BC" aria-hidden="true">#</a> \uB9AC\uB354\uAC00 \uD300 \uD559\uC2B5 \uC18D\uB3C4\uC5D0 \uBBF8\uCE58\uB294 \uC601\uD5A5</h4><p>\uB2E8\uC21C\uD788 \uAE30\uC220\uC801 \uD0C1\uC6D4\uD568\uB9CC\uC744 \uAC16\uCD98 \uC0AC\uB78C\uBCF4\uB2E4\uB294 \uD559\uC2B5 \uD658\uACBD\uC744 \uB9CC\uB4E4 \uC218 \uC788\uB294 \uB9AC\uB354\uAC00 \uD544\uC694\uD558\uB2E4\uB294 \uAC83\uC785\uB2C8\uB2E4.</p><h4 id="\u1112\u1161\u11A8\u1109\u1173\u11B8-\u1112\u116A\u11AB\u1100\u1167\u11BC\u110B\u1174-\u110E\u1161\u110B\u1175" tabindex="-1"><a class="header-anchor" href="#\u1112\u1161\u11A8\u1109\u1173\u11B8-\u1112\u116A\u11AB\u1100\u1167\u11BC\u110B\u1174-\u110E\u1161\u110B\u1175" aria-hidden="true">#</a> \uD559\uC2B5 \uD658\uACBD\uC758 \uCC28\uC774</h4><p>\uC120\uBC1C \uC790\uCCB4\uAC00 \uB9E4\uC6B0 \uD611\uB3D9\uC801</p><p>\uC18D\uB3C4\uAC00 \uBE60\uB978 \uD300\uC740 \uC0C8\uB85C\uC6B4 \uC218\uC220 \uB3C4\uC785\uC744 \uAE30\uC220\uC801 \uB3C4\uC804\uC774\uB77C\uAE30\uBCF4\uB2E4 \uC870\uC9C1\uC801 \uB3C4\uC804\uC73C\uB85C \uBC1B\uC544\uB4E4\uC600\uC2B5\uB2C8\uB2E4. \uAC1C\uAC1C\uC778\uC774 \uC0C8\uB85C\uC6B4 \uAE30\uC220\uC744 \uD68D\uB4DD\uD574\uC57C \uD55C\uB2E4\uACE0 \uBCF4\uC9C0 \uC54A\uACE0, \uD568\uAED8 \uC77C\uD558\uB294 \uC0C8\uB85C\uC6B4 \uBC29\uBC95\uC744 \uB9CC\uB4E4\uC5B4\uC57C \uD55C\uB2E4\uACE0 \uC0DD\uAC01\uD588\uC2B5\uB2C8\uB2E4.</p><p>\uB9C8\uC9C0\uB9C9\uC73C\uB85C, \uC18D\uB3C4\uAC00 \uBE60\uB978 \uD300\uC740 \uC2EC\uB9AC\uC801\uC73C\uB85C \uBCF4\uD638\uAC00 \uB418\uACE0 \uC788\uC5C8\uC2B5\uB2C8\uB2E4.</p><h4 id="\u1100\u1175\u1109\u116E\u11AF-\u110C\u1165\u11AB\u1112\u116A\u11AB\u110B\u1166-\u1109\u1165\u11BC\u1100\u1169\u11BC\u1112\u1161\u11AB-\u1100\u1162\u1107\u1161\u11AF\u1110\u1175\u11B7" tabindex="-1"><a class="header-anchor" href="#\u1100\u1175\u1109\u116E\u11AF-\u110C\u1165\u11AB\u1112\u116A\u11AB\u110B\u1166-\u1109\u1165\u11BC\u1100\u1169\u11BC\u1112\u1161\u11AB-\u1100\u1162\u1107\u1161\u11AF\u1110\u1175\u11B7" aria-hidden="true">#</a> \uAE30\uC220 \uC804\uD658\uC5D0 \uC131\uACF5\uD55C \uAC1C\uBC1C\uD300</h4><p>\uC18D\uB3C4\uAC00 \uBE60\uB978 \uD300\uC740 \uB3C4\uC804 \uC790\uCCB4\uB97C \uD300\uC758 \uD559\uC2B5 \uB2A5\uB825\uC5D0 \uB300\uD55C \uB3C4\uC804\uC73C\uB85C \uBC1B\uC544\uB4E4\uC600\uACE0, \uAC19\uC774 \uD559\uC2B5\uD574\uC57C \uD55C\uB2E4\uACE0 \uC0DD\uAC01\uD588\uC2B5\uB2C8\uB2E4.</p><p>\uC18D\uB3C4\uAC00 \uB290\uB9AC\uAC70\uB098 \uB099\uC624\uB41C \uD300\uC740 \uD559\uC2B5\uC744 \uAC1C\uC778\uC758 \uACFC\uC81C\uB85C \uCE58\uBD80\uD588\uC2B5\uB2C8\uB2E4. \uD559\uC2B5\uBCF4\uB2E4\uB294 \uB2E8\uAE30 \uD37C\uD3EC\uBA3C\uC2A4\uB97C \uC911\uC694\uC2DC\uD588\uC2B5\uB2C8\uB2E4.</p><h4 id="\u1112\u1167\u11AB\u1109\u1175\u11AF\u110B\u1166\u1109\u1165-\u1109\u1175\u11AF\u110E\u1165\u11AB\u1112\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1112\u1167\u11AB\u1109\u1175\u11AF\u110B\u1166\u1109\u1165-\u1109\u1175\u11AF\u110E\u1165\u11AB\u1112\u1161\u1100\u1175" aria-hidden="true">#</a> \uD604\uC2E4\uC5D0\uC11C \uC2E4\uCC9C\uD558\uAE30</h4><p>\uB2E4\uC2DC \uD604\uC2E4\uC5D0\uC11C \uB3CC\uC544\uC640\uC11C, \uB098\uB294 \uD300\uC7A5\uB3C4 \uC544\uB2C8\uACE0, \uC815\uCE58\uC801\uC778 \uD798\uB3C4 \uC5C6\uC2B5\uB2C8\uB2E4. \uADF8\uB807\uB2E4\uBA74 \uC774 \uC0C1\uD669\uC5D0\uC11C \uB0B4\uAC00 \uBB34\uC5C7\uC744 \uD560 \uC218 \uC788\uC744\uAE4C\uC694? \uD300\uC6D0\uACFC \uD300\uC7A5\uC5D0\uAC8C \uC774 \uCC45\uC744 \uAD8C\uD560 \uC218 \uC788\uB294 \uBD84\uC704\uAE30\uB3C4 \uC544\uB2C8\uB77C\uBA74?</p><p>\uC6B0\uC120 \uC790\uC2E0\uC758 \uD559\uC2B5 \uD658\uACBD\uC744 \uB9CC\uB4DC\uC138\uC694. \uAC70\uAE30\uC11C\uBD80\uD130\uAC00 \uCD9C\uBC1C\uC785\uB2C8\uB2E4. \uAC1C\uBCC4 \uAE30\uC220 \uC774\uC0C1\uC73C\uB85C \uC77C\uD558\uB294 \uBC29\uC2DD\uC5D0 \uB300\uD574 \uC2E4\uD5D8\uC744 \uD574 \uBCF4\uC138\uC694.</p><h3 id="\u1111\u1173\u1105\u1169\u110C\u1166\u11A8\u1110\u1173-\u1112\u116A\u11A8\u1105\u1172\u11AF\u1105\u1169\u11AB" tabindex="-1"><a class="header-anchor" href="#\u1111\u1173\u1105\u1169\u110C\u1166\u11A8\u1110\u1173-\u1112\u116A\u11A8\u1105\u1172\u11AF\u1105\u1169\u11AB" aria-hidden="true">#</a> \uD504\uB85C\uC81D\uD2B8 \uD655\uB960\uB860</h3><h4 id="\u110B\u1175\u1107\u1165\u11AB-\u1111\u1173\u1105\u1169\u110C\u1166\u11A8\u1110\u1173\u1102\u1173\u11AB-\u110C\u1166\u1104\u1164\u110B\u1166-\u1101\u1173\u11C0\u1102\u1162\u11AF-\u1109\u116E-\u110B\u1175\u11BB\u110B\u1173\u11AF-\u1100\u1165\u11BA-\u1100\u1161\u11C0\u110B\u1161\u11BB\u1102\u1173\u11AB\u1103\u1166" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u1107\u1165\u11AB-\u1111\u1173\u1105\u1169\u110C\u1166\u11A8\u1110\u1173\u1102\u1173\u11AB-\u110C\u1166\u1104\u1164\u110B\u1166-\u1101\u1173\u11C0\u1102\u1162\u11AF-\u1109\u116E-\u110B\u1175\u11BB\u110B\u1173\u11AF-\u1100\u1165\u11BA-\u1100\u1161\u11C0\u110B\u1161\u11BB\u1102\u1173\u11AB\u1103\u1166" aria-hidden="true">#</a> \uC774\uBC88 \uD504\uB85C\uC81D\uD2B8\uB294 \uC81C\uB584\uC5D0 \uB05D\uB0BC \uC218 \uC788\uC744 \uAC83 \uAC19\uC558\uB294\uB370</h4><p>\uC18C\uD504\uD2B8\uC6E8\uC5B4 \uACF5\uD559 \uCABD\uC758 \uC5F0\uAD6C\uC5D0 \uB530\uB974\uBA74 \uC0AC\uB78C\uB4E4\uC774 \uD1B5\uC0C1\uC801\uC73C\uB85C \uCD94\uC815\uD558\uB294 \uC18C\uC694\uC2DC\uAC04\uC5D0 \uC801\uC5B4\uB3C4 2~3\uBC30\uB97C \uD574\uC57C 80% \uC815\uB3C4\uC758 \uD655\uB960\uB85C \uB9C8\uCE60 \uC218 \uC788\uB294 \uC2DC\uAC04\uC774 \uB098\uC628\uB2E4\uACE0 \uD569\uB2C8\uB2E4.</p><p>\uAC8C\uB2E4\uAC00 \uC77C\uBC18\uC801\uC73C\uB85C \uC77C\uC758 \uC18C\uC694 \uC2DC\uAC04\uC744 \uCD94\uC815\uD560 \uB54C \uC0AC\uB78C\uB4E4\uC774 \uB099\uAD00\uC801\uC73C\uB85C \uCD94\uC815\uD55C\uB2E4\uB294 \uD3B8\uD5A5\uC5D0 \uB300\uD55C \uC5F0\uAD6C \uACB0\uACFC\uAC00 \uB9CE\uB2E4\uB294 \uC810\uAE4C\uC9C0 \uACE0\uB824\uD558\uBA74 \uC0C1\uD669\uC740 \uB354 \uC2EC\uAC01\uD574\uC9D1\uB2C8\uB2E4.</p><p>\uB610 \uB2E4\uB978 \uC5F0\uAD6C\uC5D0 \uB530\uB974\uBA74, \uC0AC\uB78C\uB4E4\uC5D0\uAC8C \uAC00\uC7A5 \uADF8\uB7F4\uC2F8\uD55C \uCD94\uC815(best guess)\uC744 \uBD80\uD0C1\uD588\uC744 \uB54C\uC640 \uC790\uC2E0\uC774 \uAE30\uB300\uD558\uB294 \uCD5C\uC120\uC758 \uC0C1\uD669(best case scenario)\uC744 \uC0C1\uC0C1\uD574\uC11C \uCD94\uC815\uD574\uBCF4\uB77C\uACE0 \uBD80\uD0C1\uD588\uC744 \uB54C \uADF8 \uCD94\uC815\uCE58\uB294 \uD070 \uCC28\uC774\uAC00 \uC5C6\uC5C8\uC2B5\uB2C8\uB2E4.</p><h4 id="\u110B\u1162\u110C\u1161\u110B\u1175\u11AF-\u1112\u116A\u11A8\u1105\u1172\u11AF\u1105\u1169\u11AB" tabindex="-1"><a class="header-anchor" href="#\u110B\u1162\u110C\u1161\u110B\u1175\u11AF-\u1112\u116A\u11A8\u1105\u1172\u11AF\u1105\u1169\u11AB" aria-hidden="true">#</a> \uC560\uC790\uC77C \uD655\uB960\uB860</h4><p>\uC81C\uAC00 \uC120\uD638\uD558\uB294 \uC811\uADFC\uBC95\uC740 \uAD00\uB9AC\uC790\uAC00 12\uBA85 \uBAA8\uB450\uC5D0\uAC8C \uB2E8\uC9C0 3\uAC00\uC9C0 \uC77C\uB9CC \uC8FC\uACE0 \uC11C\uB85C \uD611\uB3D9\uD574\uC11C \uADF8 \uC77C\uC744 \uD558\uB3C4\uB85D \uC694\uCCAD\uD558\uB294 \uAC83\uC785\uB2C8\uB2E4.</p><p>\uC774 \uBC29\uC2DD\uC774 \uC798 \uB3CC\uC544\uAC00\uB294 \uC774\uC720\uB294 \uC0AC\uB78C\uB4E4\uC774 &#39;\uAD00\uC2EC\uC0AC\uC758 \uC11E\uC784&#39;\uC744 \uD1B5\uD574 \uC11C\uB85C\uC5D0 \uB300\uD574 \uC5C4\uCCAD\uB098\uAC8C \uB9CE\uC740 \uAC83\uC744 \uB9E4\uC6B0 \uBE68\uB9AC \uBC30\uC6B8 \uC218 \uC788\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4.</p><p>\uC560\uC790\uC77C\uC740 \uC55E\uC11C\uC758 \uACE0\uC804\uC801 \uBC29\uBC95\uACFC \uB2EC\uB9AC \uC77C\uC744 \uACF5\uC720\uD569\uB2C8\uB2E4. \uAC01\uC790 \uC77C\uC744 \uC5BC\uB9C8\uB098 \uC9C4\uD589\uD588\uB294\uC9C0 \uB9E4\uC77C \uACF5\uC720\uD560 \uBFD0 \uC544\uB2C8\uB77C \uB0B4 \uC77C, \uB124 \uC77C\uC758 \uAD6C\uBD84\uC120\uC774 \uB69C\uB837\uD558\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4. \uC560\uC790\uC77C\uC5D0\uC11C\uB294 \uB418\uB3C4\uB85D \uC0AC\uB78C\uB4E4\uC774 \uC11E\uC774\uB3C4\uB85D \uD569\uB2C8\uB2E4.</p><p>\uC560\uC790\uC77C\uC740 \uB9C8\uCE58 \uD504\uB799\uD138 \uAD6C\uC870\uCC98\uB7FC \uBD80\uBD84 \uC18D\uC5D0 \uC804\uCCB4\uAC00 \uB4E4\uC5B4\uAC00\uAC8C \uD569\uB2C8\uB2E4. \uADF8\uB807\uAC8C \uD558\uBA74 \uACFC\uAC70\uC5D0\uC11C \uBBF8\uB798\uB97C \uC811\uCCD0 \uBCF4\uAE30\uAC00 \uD6E8\uC52C \uC27D\uC2B5\uB2C8\uB2E4. \uC77C\uC774 \uC9C4\uD589\uB420\uC218\uB85D \uC810\uC810 \uCD94\uC815 \uC815\uD655\uB3C4\uAC00 \uB192\uC544\uC9D1\uB2C8\uB2E4.</p><p>\uD55C \uC0AC\uB78C\uB9CC\uC774\uB77C\uB3C4 \uC911\uC694\uD55C \uD1B5\uCC30\uC774 \uC788\uC5C8\uB2E4\uBA74 \uC774\uAC78 \uACF5\uC720\uD574\uC11C &#39;\uB610\uB294&#39; \uD655\uB960\uB85C \uB9CC\uB4E4\uACE0, \uBC84\uADF8 \uAC19\uC774 \uB098\uC05C \uC77C\uC5D0 \uB300\uD574\uC11C\uB294 \uC5EC\uB7EC \uC0AC\uB78C\uC774 \uC911\uBCF5 \uAC80\uD1A0\uB97C \uD574\uC11C \uBAA8\uB450\uAC00 \uC2E4\uC218\uD574\uC57C\uC9C0\uB9CC \uAD6C\uBA4D\uC774 \uB098\uAC8C &#39;\uADF8\uB9AC\uACE0&#39; \uD655\uB960\uB85C \uBC14\uAFB8\uB294 \uAC83\uC785\uB2C8\uB2E4.</p><h2 id="\u110B\u1162\u110C\u1161\u110B\u1175\u11AF" tabindex="-1"><a class="header-anchor" href="#\u110B\u1162\u110C\u1161\u110B\u1175\u11AF" aria-hidden="true">#</a> \uC560\uC790\uC77C</h2><p>\uB2F9\uC2DC \uC8FC\uB3C4\uC801\uC778 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC1C\uBC1C \uBC29\uC2DD\uC740 \uACC4\uD68D\uC8FC\uB3C4\uC758 \uBC29\uC2DD\uC774\uC5C8\uC2B5\uB2C8\uB2E4. \uACC4\uD68D\uC8FC\uB3C4 \uBC29\uC2DD\uC5D0\uC11C\uB294 \uCD08\uBC18\uC5D0 \uACC4\uD68D\uC744 \uC815\uAD50\uD558\uACE0 \uAF3C\uAF3C\uD558\uAC8C \uB9CC\uB4E4\uB824\uACE0 \uC5C4\uCCAD\uB09C \uB178\uB825\uC744 \uD569\uB2C8\uB2E4. \uADF8\uB7EC\uBA74 \uC2E4\uD589\uB2E8\uACC4\uB294 \uAC04\uB2E8\uD574\uC9C0\uACE0 \uC608\uCE21 \uAC00\uB2A5\uD574\uC9C4\uB2E4\uACE0 \uC0DD\uAC01\uD558\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC560\uC790\uC77C\uC740, \uBD88\uD655\uC2E4\uC131\uC774 \uB192\uC740 \uC77C\uC5D0 \uB300\uD574\uC11C\uB294 \uC560\uCD08\uC5D0 \uC774\uAC83\uC774 \uBD88\uAC00\uB2A5\uD558\uB2E4\uACE0 \uBD05\uB2C8\uB2E4. \uBD88\uD655\uC2E4\uC131 \uD06C\uAE30 \uB54C\uBB38\uC5D0 \uBBF8\uB9AC \uBD84\uC11D\uD558\uACE0 \uC124\uACC4\uD558\uB294 \uB370 \uD55C\uACC4\uAC00 \uC788\uB2E4\uB294 \uAC83\uC774\uC9C0\uC694.</p><p>\uC774\uBC88\uC5D0\uB294 \uACFC\uC758\uC758 \uC560\uC790\uC77C\uC744 \uC598\uAE30\uD574 \uBCF4\uACA0\uC2B5\uB2C8\uB2E4. \uC560\uC790\uC77C\uC744 \uB2E8\uC21C\uD788 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC1C\uBC1C \uBC29\uBC95\uB860\uC774\uB77C\uB294 \uC6B8\uD0C0\uB9AC\uC5D0 \uAC00\uB450\uC5B4 \uBCF4\uC9C0 \uC54A\uACE0, \uC77C\uD558\uB294 \uD55C \uAC00\uC9C0 \uC2A4\uD0C0\uC77C, \uD639\uC740 \uB354 \uB118\uC5B4\uC11C\uC11C \uC0B6\uC744 \uC0AC\uB294 \uBC29\uC2DD\uC73C\uB85C\uAE4C\uC9C0 \uD655\uC7A5\uD574 \uBCF4\uB294 \uAC83\uC774\uC9C0\uC694.</p><p>\uD559\uC2B5\uACFC \uD611\uB825\uC740 \uBD88\uD655\uC2E4\uC131\uC774 \uD070 \uC0C1\uD669\uC5D0\uC11C \uC88B\uC740 \uB300\uC751\uC804\uB7B5\uC774 \uB429\uB2C8\uB2E4. \uC6B0\uB9AC\uC758 \uC0B6\uB3C4 \uBD88\uD655\uC2E4\uD558\uAE30 \uB54C\uBB38\uC5D0 \uD559\uC2B5\uACFC \uD611\uB825\uC740 \uD604\uBA85\uD55C \uC804\uB7B5\uC774 \uB420 \uAC83\uC774\uACE0\uC694.</p><h3 id="\u110B\u1162\u110C\u1161\u110B\u1175\u11AF\u110B\u1174-\u110A\u1175\u110B\u1161\u11BA" tabindex="-1"><a class="header-anchor" href="#\u110B\u1162\u110C\u1161\u110B\u1175\u11AF\u110B\u1174-\u110A\u1175\u110B\u1161\u11BA" aria-hidden="true">#</a> \uC560\uC790\uC77C\uC758 \uC528\uC557</h3><p>\uC528\uC557\uC774 \uB420\uB9CC\uD55C \uAC83\uC744 \uC918\uC57C\uD569\uB2C8\uB2E4.</p><blockquote><p>\uACE0\uAC1D\uC5D0\uAC8C \uB9E4\uC77C \uAC00\uCE58\uB97C \uC804\uD558\uB77C.</p></blockquote><h3 id="\u110B\u1162\u110C\u1161\u110B\u1175\u11AF-\u1103\u1169\u110B\u1175\u11B8-\u1109\u1165\u11BC\u1100\u1169\u11BC-\u110B\u116D\u110B\u1175\u11AB-\u1107\u116E\u11AB\u1109\u1165\u11A8" tabindex="-1"><a class="header-anchor" href="#\u110B\u1162\u110C\u1161\u110B\u1175\u11AF-\u1103\u1169\u110B\u1175\u11B8-\u1109\u1165\u11BC\u1100\u1169\u11BC-\u110B\u116D\u110B\u1175\u11AB-\u1107\u116E\u11AB\u1109\u1165\u11A8" aria-hidden="true">#</a> \uC560\uC790\uC77C \uB3C4\uC785 \uC131\uACF5 \uC694\uC778 \uBD84\uC11D</h3><p>\uB450\uB824\uC6CC\uB3C4 \uC911\uC694\uD558\uB2E4\uBA74 \uC2DC\uB3C4\uD574\uBD10\uC57C \uD558\uC9C0 \uC54A\uACA0\uB294\uAC00</p><h3 id="\u1103\u1161\u11BC\u1109\u1175\u11AB\u110B\u1174-\u110C\u1169\u110C\u1175\u11A8\u110B\u1166-\u1109\u1162-\u1107\u1161\u11BC\u1107\u1165\u11B8\u1105\u1169\u11AB\u110B\u1175-\u1106\u1165\u11A8\u1112\u1175\u110C\u1175-\u110B\u1161\u11AD\u1102\u1173\u11AB-\u110B\u1175\u110B\u1172" tabindex="-1"><a class="header-anchor" href="#\u1103\u1161\u11BC\u1109\u1175\u11AB\u110B\u1174-\u110C\u1169\u110C\u1175\u11A8\u110B\u1166-\u1109\u1162-\u1107\u1161\u11BC\u1107\u1165\u11B8\u1105\u1169\u11AB\u110B\u1175-\u1106\u1165\u11A8\u1112\u1175\u110C\u1175-\u110B\u1161\u11AD\u1102\u1173\u11AB-\u110B\u1175\u110B\u1172" aria-hidden="true">#</a> \uB2F9\uC2E0\uC758 \uC870\uC9C1\uC5D0 \uC0C8 \uBC29\uBC95\uB860\uC774 \uBA39\uD788\uC9C0 \uC54A\uB294 \uC774\uC720</h3><p>\uACB0\uACFC\uB4E4\uC744 \uBCF4\uBA74 \uC0C1\uB2F4\uC5D0\uC11C \uC5B4\uB5A4 \uAE30\uBC95\uC744 \uC4F0\uB290\uB0D0\uBCF4\uB2E4 \uCE58\uB8CC\uC790\uAC00 \uB204\uAD6C\uC778\uAC00\uAC00 \uC0C1\uB2F4 \uD6A8\uACFC\uC5D0 \uB354 \uD070 \uC601\uD5A5\uC744 \uC900\uB2E4\uB294 \uAC8C \uAC70\uB4ED \uBC1D\uD600\uC84C\uC2B5\uB2C8\uB2E4.</p><p>\uB9E4\uB274\uC5BC\uC774 \uB9D0\uD558\uACE0 \uC788\uB294 \uAC83\uBCF4\uB2E4 \uD6E8\uC52C \uB354 \uB9CE\uC740 \uAC83\uC744 \uC0C1\uB2F4\uC0AC\uB4E4\uC774 \uD560 \uC218 \uC788\uB2E4\uB294 \uB9D0\uC774 \uB420 \uAC83\uC785\uB2C8\uB2E4.</p><p>\uC0AC\uC2E4 \uB354 \uB098\uC544\uAC00\uC11C \uBAA8\uB4E0 \uC9C0\uC2DD\uC774 \uADFC\uBCF8\uC801\uC73C\uB85C\uB294 \uC554\uBB35\uC9C0\uB77C\uACE0 \uC5ED\uC124\uD588\uC2B5\uB2C8\uB2E4.</p><p>\uB9E5\uB77D\uC744 \uAC00\uB85C\uC9C0\uB974\uB294 \uBCF4\uD3B8\uC801 \uADDC\uCE59\uB4E4\uC774 \uBCC4\uB85C \uC5C6\uB2E4\uACE0 \uC0DD\uAC01\uC774 \uB4E0\uB2E4\uBA74, \uACB0\uACFC\uB97C \uC5D0\uCE21\uD558\uAE30 \uC5B4\uB835\uACE0 \uBD88\uD655\uC2E4\uC131\uC774 \uB192\uB2E4\uBA74, \uD574\uB2F9 \uBD84\uC57C\uB294 &#39;\uBCF5\uC7A1\uD55C \uB3C4\uBA54\uC778&#39;\uC774 \uB429\uB2C8\uB2E4. \uC0C1\uB2F4\uC774 \uADF8\uB807\uC8E0. \uC774\uB7F0 \uBCF5\uC7A1\uD55C \uBD84\uC57C\uC77C\uC218\uB85D \uC5B4\uB5A4 \uD2B9\uC815 \uAE30\uBC95\uC758 \uD6A8\uACFC\uBCF4\uB2E4\uB3C4 \uCE58\uB8CC\uC790 \uD6A8\uACFC\uAC00 \uB354 \uD070 \uC601\uD5A5\uC744 \uBBF8\uCE60 \uAC83\uC785\uB2C8\uB2E4.</p><p>\uB0B4\uAC00 \uC5B4\uB5A4 \uD300\uC7A5\uC778\uC9C0\uAC00 \uC804\uD600 \uBC14\uB00C\uC9C0 \uC54A\uC73C\uBA74\uC11C \uC0C8 \uBC29\uBC95\uB860\uB9CC \uB3C4\uC785\uD55C\uB2E4\uACE0 \uBB34\uC2A8 \uD6A8\uACFC\uAC00 \uC788\uC744\uAE4C\uC694.</p><h3 id="\u110B\u1162\u110C\u1161\u110B\u1175\u11AF\u110B\u1173\u11AF-\u110B\u1162\u110C\u1161\u110B\u1175\u11AF\u1109\u1173\u1105\u1165\u11B8\u1100\u1166-\u1103\u1169\u110B\u1175\u11B8\u1112\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u110B\u1162\u110C\u1161\u110B\u1175\u11AF\u110B\u1173\u11AF-\u110B\u1162\u110C\u1161\u110B\u1175\u11AF\u1109\u1173\u1105\u1165\u11B8\u1100\u1166-\u1103\u1169\u110B\u1175\u11B8\u1112\u1161\u1100\u1175" aria-hidden="true">#</a> \uC560\uC790\uC77C\uC744 \uC560\uC790\uC77C\uC2A4\uB7FD\uAC8C \uB3C4\uC785\uD558\uAE30</h3><p>\uCE78\uBC18 \uAC19\uC740 \uAC1C\uBCC4 \uC2E4\uCC9C\uBC95\uC740 \uC0C1\uC2DC \uBCC0\uD654\uD558\uACE0 \uBC1C\uC804\uD558\uB294 \uB3C4\uC694\uD0C0\uC758 \uD2B9\uC815 \uC2DC\uC810\uC758 \uC2A4\uB0C5\uC0F7 \uAC19\uC740 \uAC83\uC774 \uC544\uB2D0\uAE4C \uC0DD\uAC01\uD569\uB2C8\uB2E4. \uC6B0\uB9AC\uAC00 \uBC30\uC6CC\uC57C \uD560 \uAC83\uC740 \uCE78\uBC18 \uC774\uBA74\uC758, \uCE78\uBC18\uC774 \uB098\uC62C \uC218 \uC788\uC5C8\uB358 \uAD6C\uC870\uC758 \uBB38\uD654\uC785\uB2C8\uB2E4.</p><p>&quot;... \uC560\uC790\uC77C\uC744 \uB3C4\uC785\uD560 \uB54C \uD655\uC2E4\uC131 \uC704\uC5D0\uC11C \uC9C4\uD589\uD558\uB824\uACE0 \uD55C\uB2E4\uBA74 \uBB38\uC81C\uAC00 \uB41C\uB2E4&quot;</p><p>\uC774\uAC83\uC740 \uAC70\uC758 \uBAA8\uB4E0 \uC885\uB958\uC758 \uBC29\uBC95\uB860 \uB3C4\uC785\uC5D0 \uC801\uC6A9\uB429\uB2C8\uB2E4. \uC65C\uB0D0\uD558\uBA74 \uBC29\uBC95\uB860 \uB3C4\uC785\uC740 \uD0DC\uC0DD\uC801\uC73C\uB85C \uBD88\uD655\uC2E4\uC131\uC774 \uB192\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4. ... \uC218\uC21C\uC744 \uB530\uB974\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C \uACC1\uC5D0 \uC788\uB294 \uC0AC\uB78C\uB4E4\uACFC \uD568\uAED8 \uC8FC\uBCC0\uC744 \uD0D0\uC0C9\uD558\uACE0 \uC870\uAE08 \uB098\uC544\uAC00\uACE0 \uD655\uC778\uD558\uACE0\uB97C \uBC18\uBCF5\uD558\uBA74\uC11C \uC6B0\uB9AC\uC758 \uD604 \uB9E5\uB77D\uC5D0 \uB9DE\uB294 \uC88B\uC740 \uC804\uB7B5\uB4E4\uC744 \uC2A4\uC2A4\uB85C \uB9CC\uB4E4\uC5B4 \uB098\uAC00\uB294 \uAC83\uC774 \uC544\uB2D0\uAE4C \uD569\uB2C8\uB2E4</p>',252);function _(q,k){const d=e("ExternalLinkIcon"),i=e("ProgressBar");return n(),t(s,null,[a("h1",l,[u,b,a("a",f,[x,h(d)])]),h(i,{name:"\uD568\uAED8\uC790\uB77C\uAE30",max:220,value:220}),g],64)}var B=p(o,[["render",_]]);export{B as default};
